INSERT INTO `currency_project` VALUES (1,28,3,'The Sandbox','aa','一个基于以太坊的虚拟世界',0.00038758,'360000000',NULL,'<p>The Sandbox是一个虚拟游戏世界，通过基于以太坊的功能型代币SAND，玩家可以创建和拥有不同的游戏体验，并从中获得收益。游戏玩家可以通过The Sandbox Game Maker，来创建数字资产(非同质化代币，也称NFT)，将其上传到商店，并通过简单的拖拉方式来创建游戏体验。The Sandbox已经与包括ATARI，Crypto Kitties加密猫，Shaun the Sheep等50多个合作伙伴建立了合作关系，来建立由玩家创作和拥有的“边玩边赚”的创意游戏平台。 The Sandbox旨在通过区块链技术所带来的真正的所有权、数字稀缺性、盈利能力和互操作性的优势，来吸引更多的加密和非加密游戏爱好者，将区块链带入主流游戏世界。</p>','2021-02-05','2021-02-05',NULL,'www.baidu.com','www.google.com',2,'2021-02-05 16:31:00',NULL),(2,1,1,'123',NULL,'213',213.00000000,NULL,NULL,'<p>123</p>','2021-02-05','2021-02-05',NULL,'123','213',2,'2021-02-05 16:33:02',NULL),(3,2,3,'MEC','https://www.korbit.cc/upload/1612503931568697.jpg','医疗链(MEC)',0.50000000,'50000',NULL,'<p>医疗链(MEC)是一条自行开发的公共链,旨在建立一个集成了开发数据管理和基于5G技术的操作系统的物联网平台, 已将区块链技术不断集成到医疗行业中。未来Medical Chain(MEC)将寻求发展其在医学信息化领域的领先地位,&nbsp; 致力于使用区块链技术来解决全球医学信息透明，数据互通阻塞和情报不足的问题。新的发展使全球医疗信息化得以加速， 持续的发展，从而允许创建开放式医院来为全球有多种医疗需求的用户提供服务。</p>','2021-02-05','2021-02-05','2021-02-05','https://www.korbit.cc/upload/mec_white_book.pdf','水电费？',2,'2021-02-05 16:31:57',NULL),(5,29,3,'USDT','http://uinfinance.com/upload/1641612849631593.png','USDT',0.05000000,'37698494',NULL,'<p>(MEC)是一条自行开发的公共链,旨在建立一个集成了开发数据管理和基于5G技术的操作系统的物联网平台, 已将区块链技术不断集成到医疗行业中。未来Medical Chain(MEC)将寻求发展其在医学信息化领域的领先地位, 致力于使用区块链技术来解决全球医学信息透明，数据互通阻塞和情报不足的问题。新的发展使全球医疗信息化得以加速， 持续的发展，从而允许创建开放式医院来为全球有多种医疗需求的用户提供服务。The Medical Chain (MEC) is a self-developed public chain that aims to establish an IoT platform that integrates development data management and an operating system based on 5G technology. Blockchain technology has been continuously integrated into the medical industry. In the future, Medical Chain (MEC) will seek to develop its leading position in the field of medical informatization, and is committed to using blockchain technology to solve the problems of global medical information transparency, data interoperability blocking and insufficient intelligence. New developments have accelerated the global medical informatization and continued development, allowing the creation of open hospitals to provide services for users with multiple medical needs worldwide.</p><p><br/></p>','2022-01-08','2022-01-08','2021-05-01','https://www.korbit.cc/upload/mec_white_book.pdf','https://www.korbit.cc/upload/mec_white_book.pdf',1,'2022-01-08 11:34:54',NULL),(6,5,3,'医疗链(MEC增发)','https://www.upbit1.cc/upload/1615376532658760.jpg','医疗链(MEC增发)',0.50000000,'20000000',NULL,'<p>医疗链(MEC)是一条自行开发的公共链,旨在建立一个集成了开发数据管理和基于5G技术的操作系统的物联网平台, 已将区块链技术不断集成到医疗行业中。未来Medical Chain(MEC)将寻求发展其在医学信息化领域的领先地位,&nbsp; 致力于使用区块链技术来解决全球医学信息透明，数据互通阻塞和情报不足的问题。新的发展使全球医疗信息化得以加速， 持续的发展，从而允许创建开放式医院来为全球有多种医疗需求的用户提供服务。</p>','2021-03-10','2021-03-10',NULL,'https://www.korbit.cc/upload/mec_white_book.pdf','https://www.korbit.cc/upload/mec_white_book.pdf',2,'2021-03-10 19:45:38',NULL),(7,8,3,'医疗链(MEC增发)','https://www.upbit1.cc/upload/1615431119535181.jpg','医疗链(MEC增发)',0.50000000,'200,000.00',NULL,'<p>医疗链(MEC)是一条自行开发的公共链,旨在建立一个集成了开发数据管理和基于5G技术的操作系统的物联网平台, 已将区块链技术不断集成到医疗行业中。未来Medical Chain(MEC)将寻求发展其在医学信息化领域的领先地位, 致力于使用区块链技术来解决全球医学信息透明，数据互通阻塞和情报不足的问题。新的发展使全球医疗信息化得以加速， 持续的发展，从而允许创建开放式医院来为全球有多种医疗需求的用户提供服务。The Medical Chain (MEC) is a self-developed public chain that aims to establish an IoT platform that integrates development data management and an operating system based on 5G technology. Blockchain technology has been continuously integrated into the medical industry. In the future, Medical Chain (MEC) will seek to develop its leading position in the field of medical informatization, and is committed to using blockchain technology to solve the problems of global medical information transparency, data interoperability blocking and insufficient intelligence. New developments have accelerated the global medical informatization and continued development, allowing the creation of open hospitals to provide services for users with multiple medical needs worldwide.</p>','2021-03-11','2021-03-11',NULL,'https://www.korbit.cc/upload/mec_white_book.pdf','https://www.korbit.cc/upload/mec_white_book.pdf',2,'2021-03-11 11:02:46',NULL),(8,27,3,'A5源码网','http://uinfinance.com/upload/1641612791304329.png','A5源码网（www.a5yuanma.cn）精品资源分享网站',1.00000000,'100000',NULL,'<p>A5源码网（www.a5yuanma.cn）精品资源分享网站 <br/></p>','2022-01-08','2022-02-08',NULL,'https://www.a5yuanma.cn/','https://www.a5yuanma.cn/',1,'2022-01-08 11:35:57',NULL);
