  `end_price` decimal(20,8) unsigned NOT NULL DEFAULT '0.00000000' COMMENT '收盘价',
  `fee` decimal(20,8) unsigned NOT NULL COMMENT '手续费',
  `profit_ratio` decimal(20,2) unsigned NOT NULL COMMENT '收益率',
