INSERT INTO `news` VALUES (60,19,'zh','OTC交易规则',0,0,1,0,'管理员',0,'OTC交易规则','OTC交易规则','<p>OTC交易基本原则：</p><p>&nbsp; 1、本规则自发布之日起正式实施，并将不时予以修改或完善，修改或完善后的新规则自公布之日起即生效；</p><p>&nbsp; 2、如您不同意本规则及修改或完善后的规则内容，请立即停止使用平台服务；</p><p>&nbsp; 3、如您继续使用平台服务的，视为您完全理解并接受本规则及不时修改或完善后的规则内容，并自愿受其约束。</p><p>&nbsp;</p><p>&nbsp; 买方应遵循的原则：</p><p>&nbsp; 创建订单后，买方应当：</p><p>&nbsp; 1、 在订单规定的付款时间内完成支付，再点击“我已付款”；</p><p>&nbsp; 2、 使用本人实名付款方式、按订单金额及订单指定的收款账户以实时到账方式完成订单支付；</p><p>&nbsp; 3、 选择非实时到账方式支付订单的，必须事先获得卖方同意；</p><p>&nbsp; 4、 支付订单不得备注“数字货币、BTC、比特币、DF”等信息；</p><p>&nbsp;</p><p>&nbsp; 卖方应遵循的原则：</p><p>&nbsp; 生成订单后，卖方应当：</p><p>&nbsp; 1、 提供经平台认证的收款账户；</p><p>&nbsp; 2、 收到买方全额付款后，在订单规定时间内完成放行；</p><p>&nbsp; 3、 非经买方同意，不得要求买家/客服取消订单；</p><p>&nbsp; 4、 非经买方同意，不得对已创建的订单价格提出异议；</p><p>&nbsp;</p><p>&nbsp; 注：非实时到账方式目前包括：支付宝转银行卡、微信转银行卡、17:00-9:00超5万订单用单笔转账等方式，随着各支付通道业务的变化，非实时到账方式的具体类型将相应进行调整。</p><p><br/></p><p>用户应遵守反洗钱原则：</p><p><br/></p><p>1、用户应遵守平台的《Upbit Rok平台反洗钱和反恐怖融资用户指引》并严格照此履行相关义务；</p><p><br/></p><p>2、用户应严格遵循平台对用户身份及账户的实名认证管理要求，确保在平台上显示的相关账号均系本人合法注册、使用的；</p><p><br/></p><p>3、用户在触发平台的反洗钱风控预警时，应积极配合平台的进一步反洗钱核实工作，并积极协助提供相关的风控举证材料（具体措施以届时平台风控审核要求为准）。</p><p>买方异常</p><p><br/></p><p>处理措施</p><p><br/></p><p>1、订单创建后，买方取消订单。</p><p><br/></p><p>当日达到3次，系统将限制买方买入功能；连续2日触发，系统将进一步限制买方账户部分功能。</p><p><br/></p><p>2、订单创建后，因付款超时而系统自动取消订单。</p><p><br/></p><p>当日达到3次，系统将限制买方买入功能；连续2日触发，系统将进一步限制买方账户部分功能。</p><p><br/></p><p>3、未付款的情况下，点击“我已付款”。</p><p><br/></p><p>卖方有权要求取消此笔订单，买方当日被投诉达到2次，系统将限制买方账户部分功能；此类投诉单笔金额超过5万人民币的，系统将直接限制买方账户48小时。</p><p><br/></p><p>4、未付款的情况下，无故点击“申诉”或先点击“申诉”再付款。</p><p><br/></p><p>卖方有权要求取消此笔订单，买方当日被投诉达到2次，系统将限制买方账户部分功能；</p><p><br/></p><p>5、未按照卖方订单详情页面显示的收款账户进行付款。</p><p><br/></p><p>卖家有权要求取消订单，数字资产归还给卖方，买方自行承担转错款的风险。</p><p><br/></p><p>6、未按照卖方在订单聊天窗口中提供的与绑定账户实名一致的账户付款。</p><p><br/></p><p>卖家有权要求取消订单，数字资产归还给卖方，买方自行承担转错款的风险。</p><p><br/></p><p>7、未付款的情况下，优先点击“我已付款”，再进行支付。</p><p><br/></p><p>卖方有权选择继续成交或者退款后取消订单。</p><p>&nbsp; 1）如卖方选择成交，卖方用户需要在收到全部付款的10分钟内完成放行；</p><p>&nbsp; 2）如卖方选择取消订单，卖方应在订单申诉后2小时内完成退款，数字资产归还给卖方。</p><p><br/></p><p>8、未使用与平台账户实名一致的支付账户付款。</p><p><br/></p><p>卖方有权直接拒绝成交，卖方可在收到付款后的24小时内完成退款处理，数字资产归还给卖方。使用企业账户付款（不论法人与认证本人实名是否一致），依然属于非实名支付。买方因此类情况被投诉达到2次，系统将永久限制买方账户买入功能。</p><p><br/></p><p>9、在订单规定的付款时间内付款，订单被取消。</p><p>&nbsp; （1）买方已完成所有付款，订单被买方主动取消或被系统超时取消；</p><p>&nbsp; （2）买方完成部分付款，但订单被买方主动取消或被系统超时取消。</p><p><br/></p><p>订单被买方主动取消以及订单被系统超时取消的，卖方有权选择继续成交或者退款不成交。</p><p><br/></p><p>1、如卖方选择成交，</p><p>&nbsp; —卖方是普通用户，订单由平台直接重开，卖方需在重开后，10分钟内完成资产放行。</p><p>&nbsp; —卖方是广告方用户，订单金额≤5万，请使用“重开订单并放行”完成资产放行操作；订单金额＞5万，请在平台重开订单10分钟内完成资产放行。</p><p>&nbsp;</p><p>&nbsp; 2、如卖方选择取消订单，则卖方需在收到平台或者买方用户反馈后60分钟内完成退款，数字资产归还给卖方；</p><p><br/></p><p>10、如分开付款，未完成所有转款的情况下，优先点击“我已付款”，再继续完成付款。</p><p><br/></p><p>1）提前与卖方沟通，卖方允许其行为的，卖方应继续完成订单；</p><p>&nbsp; 2）未征得卖方同意或并未与卖方沟通，卖方有权选择继续成交或者退款后取消订单。</p><p>&nbsp; —如卖方选择继续成交，卖方应在收到所有付款的10分钟内完成放行。</p><p>&nbsp; —如卖方选择取消订单，则卖方需在收到付款后30分钟内完成退款，数字资产归还给卖方。</p><p><br/></p><p>11、付款金额与订单金额不符。</p><p><br/></p><p>1）付款金额大于订单金额的，订单成交，卖家应于收到款项后30分钟内退还多余部分款项。</p><p>&nbsp; 2）付款金额小于订单金额的，卖方有权选择继续成交或者退款后要求取消订单。</p><p>&nbsp; —如卖方选择继续成交，有权按实际订单金额进行成交，并完成此订单。</p><p>&nbsp; —如卖方选择取消订单，则卖方需在收到付款后30分钟内完成退款，数字资产归还给卖方。</p><p><br/></p><p>12、买方点击“我已付款”后，卖方1小时内未收到付款。</p><p><br/></p><p>1）除买方付款方式已事先获得卖方同意的，卖方有权选择继续成交或退款后取消订单。</p><p>&nbsp; —如卖方选择成交，卖方需要在收到付款的10分钟内完成放行。</p><p>&nbsp; —如卖方选择取消订单，则卖方需在收到付款后30分钟内完成退款，数字资产归还给卖方。</p><p>&nbsp;</p><p>&nbsp; 2）卖方是广告发布方，申诉后10分钟内无法联系上买方，经核实卖方未收到款，在广告方保证资产范围内申诉专员会优先取消订单。</p><p><br/></p><p>13、付款到账后，卖方收款账户无法核实到账实名信息。</p><p><br/></p><p><br/></p><p>&nbsp; 1）经核实买方付款账户与平台实名账户一致，且在订单规定时间内完成了付款，此订单正常成交。</p><p>&nbsp;</p><p>&nbsp; 2）经核实买方付款账户与平台实名账户不一致，按上述第7条措施处理。</p><p><br/></p><p>14、使用未经卖方同意的非实时到账方式支付订单的。</p><p><br/></p><p>卖方有权选择继续成交或退款后要求取消订单：</p><p>&nbsp; —如卖方选择成交，卖方需要在收到付款的10分钟内完成放行。</p><p>&nbsp; —如卖方选择取消订单，则卖方需在收到付款后30分钟内完成退款，数字资产归还给卖方；</p><p><br/></p><p>15、节假日或工作日当日17:00-次日9:00，银行卡汇款超过5万以上未分批支付导致卖方无法在1小时内收到转款。</p><p><br/></p><p>卖方有权选择继续成交或取消订单后退款。</p><p>&nbsp; —如卖方选择成交，卖方需要在收到付款的10分钟内完成放行。</p><p>&nbsp; —如卖方选择取消订单，则卖方需在收到付款后30分钟内完成退款，数字资产归还给卖方。</p><p><br/></p><p>16、因买方付款导致卖方收款账户异常。</p><p><br/></p><p>1）买方无法提供账户正常证明，卖方应在收款账户转至正常后，24小时内完成退款，平台取消订单。</p><p>&nbsp; 2）买方能提供账户正常证明，在核实买方账户无异常后，订单成交，数字资产应交付买方。</p><p>&nbsp;</p><p>&nbsp; 如：卖方为加V用户，在保证资产范围内，数字资产归还给卖方，卖方应在收款账户转至正常后，24小时内完成退款。</p><p><br/></p><p>17、付款时备注：类似”数字货币、BTC、比特币、DF“等字样的。</p><p><br/></p><p>卖方有权选择继续成交或退款不成交。</p><p>&nbsp; 1）如卖方选择成交，卖方应在收到付款的10分钟内完成放行。</p><p>&nbsp; 2）如卖方选择退款不成交，此订单取消，数字资产归还给卖方，卖方在收到付款后60分钟内完成退款；如卖方收款账户因此被冻结，按上述第16条措施处理。</p><p><br/></p><p>18、买方用户被风控系统判断恶意抢拍低价单</p><p><br/></p><p>1）买方未付款，平台将取消订单，资产归还给卖方。</p><p><br/></p><p>2）买方已付款，请卖方在申诉处理的10分钟内完成退款处理，平台将协助取消订单，资产归还给卖方。</p><p><br/></p><p>买方此类行为达到两次，风控系统将会限制买方账户部分功能。</p><p><br/></p><p>　注：本规则涉及卖方退款或放行，而卖家未按时完成操作的，系统将限制卖方账户部分功能。</p><p><br/></p><p><br/></p><p>卖方异常</p><p><br/></p><p>处理措施</p><p><br/></p><p>1、订单生成后，对订单价格有异议的。</p><p><br/></p><p>除经买方同意协商订单价格外，订单正常成交，卖方应在订单规定时间内放行。</p><p><br/></p><p>2、卖方所提供收款账户出现异常。&nbsp;</p><p><br/></p><p>买方有权选择继续成交或取消订单。</p><p>&nbsp; —如买方选择成交，确认买方已在订单规定的时间内全额付款的，卖家应在收到付款后，在订单规定的时间完成放行。</p><p>&nbsp; —如买方选择取消订单的，卖方完成退款后数字资产归还给卖方。</p><p><br/></p><p>3、因卖方未及时提供有效的收款方式，买方无法完成付款，导致订单取消。</p><p><br/></p><p>因卖方不提供收款方式，此订单无法成交，平台在处理申诉时，会直接取消订单，并对卖方用户做处罚，平台取消订单不计买方当天取消次数；</p><p><br/></p><p>卖方因此被投诉达到2次，系统将限制卖方账户部分功能。</p><p><br/></p><p>4、卖方（非广告方），未绑定与本人实名一致的有效收款信息或向买方提供与平台实名不一致的收款方式，如：通过支付宝或者微信收款时，账号以及二维码收款人姓名与订单详情页展示的收款人姓名不匹配。</p><p><br/></p><p>1）买方有权取消订单并向平台投诉。</p><p>&nbsp; 2）卖方因此被投诉达到3次，系统将会永久限制卖方账户。</p><p>&nbsp; 3）买方选择继续成交的，由此引发的风险，由买方自行承担。</p><p><br/></p><p>5、买方付款账户信息与平台实名信息不一致，未拒绝成交的。</p><p><br/></p><p>1）由此引发的风险，由卖方自行承担。</p><p>&nbsp; 2）因此而被投诉的，系统将限制卖方账户部分功能。</p><p><br/></p><p>6、买方全额付款后标记“我已付款”，卖方收到买方全额付款后，未在20分钟内完成放行。</p><p><br/></p><p>买方有权选择继续成交或取消订单后要求退款。</p><p>&nbsp; —如买方选择成交，申诉专员将判定资产属于买方。</p><p>&nbsp; —如买方要求退款后取消订单，卖方应在后30分钟内完成退款。</p><p><br/></p><p>如：买方在标记付款20分钟以内点击申诉，导致卖方无法放行，且卖方在聊天窗无法与买方取得联系，此订单将正常成交。</p><p><br/></p><p>7、买方全额付款后标记“我已付款”，卖方收到买方全额付款后，卖方未放行点击申诉，且20分钟以内未完成放行。</p><p><br/></p><p>买方有权选择继续成交或取消订单后要求退款。</p><p>&nbsp; —如买方选择成交，申诉专员将判定资产属于买方。</p><p>&nbsp; —如买方要求退款后取消订单，卖方应在后30分钟内完成退款。</p><p><br/></p><p><br/></p><p>触发风控异常</p><p><br/></p><p>处理措施</p><p><br/></p><p>1、当用户被风控系统检测到异常，用户明确拒绝或不积极配合完成平台风控要求的进一步反洗钱核查工作。</p><p><br/></p><p>本平台将有权选择直接认定为此账户异常，并对此采取包括但不限于上调用户风险等级、直接冻结此类用户的账户及关联账户直至用户配合提供的风控举证材料已通过平台的风控审核。</p><p><br/></p><p>2、当用户被平台风控核实出有涉嫌诈骗（或试图诈骗未遂）、提币至各类高危平台（包括但不限于：承兑商平台、网络博彩平台、涉嫌洗钱诈骗平台或其他低风控能力平台）或其他高风险资产转移行为。</p><p><br/></p><p>风险提醒：所有将本平台和此类平台关联起来的宣传皆为虚假宣传， 谨防上当受骗，造成不必要的财产损失。</p><p><br/></p><p>本平台将视情况有权选择直接冻结或限制此类用户及关联账号账户的OTC交易、提币，甚至禁用账号所有权限。</p><p><br/></p><p>3、账户非本人使用或为他人非法代买币：当用户被平台风控核实出账户存在出售、出借、租赁自身账户为他人使用的情况，或存在为他人非法代买币的行为。</p><p>&nbsp; 风险提醒：请注意自身信息安全，避免被他人利用进行犯罪行为。</p><p><br/></p><p>本平台将有权选择包括但不限于暂时或永久限制OTC交易、延迟提币、限制提币或直接冻结此类用户的账户及关联账户等某项或多项措施。</p><p><br/></p><p>4、利用平台其他用户测卡：用户在订单未发生的情况下向平台其他用户小额打款，且无法合理解释该行为时。</p><p><br/></p><p>本平台将有权选择暂时或永久限制OTC交易、限制提币或冻结账户等某项或多项措施。</p><p><br/></p><p>5、接收或引入来源不合法的数字资产或资金：当用户明知或据合理常识判断可推知在其他平台/微信群收到的币为黑币或资金为黑钱时，但仍无视风险并直接将该黑币/黑钱流入到本平台其它用户的账户。</p><p><br/></p><p>本平台将直接永久限制此类用户的账户及关联账户全部功能。</p><p><br/></p><p>6、被认定洗钱的用户：当用户被风控系统检测或风控工作人员核实，用户直接参与或协助洗黑钱等犯罪行为。</p><p><br/></p><p>本平台将直接永久限制此类用户的账户及关联账户全部功能。</p><p><br/></p><p>7、被司法冻结：当用户账户被司法机构要求冻结时。</p><p><br/></p><p>本平台将严格按照司法机构出示的司法函件对用户账户进行冻结。当冻结期满，司法机构需出示续冻函方可继续冻结。冻结期间，用户向本平台申请解冻无效，请联系冻结机构协调。</p><p><br/></p><p>8、被司法调证：用户被司法机构要求调取本平台账户资料，包括但不限于：司法调证、咨询等形式。</p><p><br/></p><p>本平台将视情况限制此类用户的账户及关联账户的部分功能。</p><p><br/></p>',0,1509638400,1509638400,'http://lequ4.m88mo.cn/images/zwtp.png','https://www.COINYMH.cc/images/zwtp.png',95),(61,19,'zh','隐私政策',0,0,0,0,'管理员',0,'隐私政策','隐私政策','<p>【导言及提示条款】</p><p><br/></p><p>Upbit Rok.（以下称 “公司”）是一家根据韩国相关法律在韩国注册成立的公司，该公司运营Upbit Rok&nbsp; APP（以下称“本平台”或“平台”），该平台是一个专门供用户进行数字资产交易和提供相关服务（以下称“该服务”或“服务”）的平台。为了表述之方便，公司和该平台在本协议中合称 “我们”或其他第一人称称呼，只要登陆该平台的自然人或其他主体均为本平台的用户，以下使用“您”或其他第二人称，我们和您合称为“双方”，我们或您单称为“一方”。</p><p><br/></p><p>我们充分理解与尊重您的个人信息对您的重要性，我们将按法律法规要求，采取相应安全保护措施，保护您的个人信息安全。鉴于此，制定本《隐私政策》（下称“本政策 /本隐私政策”）并提醒您：</p><p><br/></p><p>本政策适用于我们提供的所有产品和服务。如我们向您提供的产品或服务单独设立有隐私政策的，则该产品或服务适用其单独设立的隐私政策；如我们的产品或服务未单独设立隐私政策的，则适用于本政策。</p><p><br/></p><p>需要特别说明的是，本政策不适用于其他第三方向您提供的服务，第三方向您提供的服务适用其向您另行说明的隐私政策。</p><p><br/></p><p>在使用我们各项产品或服务前，请您务必仔细阅读并透彻理解本政策，特别是以粗体/粗体下划线标识的条款，您应重点阅读，在确认充分理解并同意后再开始使用。如对本政策内容有任何疑问、意见或建议，您可通过我们官方提供的各种联系方式与我们联系。如您不同意本政策中的任何条款，您应立即停止访问本平台。</p><p><br/></p><p>&nbsp;</p><p><br/></p><p>第一部分 定义</p><p><br/></p><p>个人信息：指以电子或者其他方式记录的能够单独或者与其他信息结合识别特定自然人身份或者反映特定自然人活动情况的各种信息。</p><p><br/></p><p>个人敏感信息：指包括身份证件号码、个人生物识别信息、银行账号、财产信息、行踪轨迹、交易信息、14岁以下（含）儿童信息等的个人信息（我们将在本隐私权政策中对具体个人敏感信息以粗体进行显著标识）。</p><p><br/></p><p>个人信息删除：指在实现日常业务功能所涉及的系统中去除个人信息的行为，使其保持不可被检索、访问的状态。</p><p><br/></p><p>儿童：指不满十四周岁的未成年人。</p><p><br/></p><p>第二部分&nbsp; 隐私政策</p><p><br/></p><p>本隐私政策部分将帮助您了解以下内容：</p><p><br/></p><p>一、我们如何收集和使用您的信息</p><p><br/></p><p>二、我们如何使用Cookie和同类技术</p><p><br/></p><p>三、我们如何共享、转让、公开披露您的信息</p><p><br/></p><p>四、我们如何保护您的信息</p><p><br/></p><p>五、您如何管理您的信息</p><p><br/></p><p>六、我们如何处理未成年人的信息</p><p><br/></p><p>七、本隐私政策如何更新</p><p><br/></p><p>八、如何联系我们</p><p><br/></p><p>&nbsp;</p><p><br/></p><p>一、 我们如何收集和使用您的信息</p><p><br/></p><p>在您使用我们的产品及/或服务时，我们需要/可能需要收集和使用的您的个人信息包括如下两种：</p><p><br/></p><p>1、为实现向您提供我们产品及/或服务的基本功能，您须授权我们收集、使用的必要的信息。如您拒绝提供相应信息，您将无法正常使用我们的产品及/或服务；</p><p><br/></p><p>2、为实现向您提供我们产品及/或服务的附加功能，您可选择授权我们收集、使用的信息。如您拒绝提供，您将无法正常使用相关附加功能或无法达到我们拟达到的功能效果，但并不会影响您正常使用我们产品及/或服务的基本功能。</p><p><br/></p><p>您理解并同意：</p><p><br/></p><p>1、我们致力于打造多样的产品和服务以满足您的需求。因我们向您提供的产品和服务种类众多，且不同用户选择使用的具体产品/服务范围存在差异，相应的，基本/附加功能及收集使用的个人信息类型、范围等会有所区别，请以具体的产品/服务功能为准；</p><p><br/></p><p>2、为给您带来更好的产品和服务体验，我们在持续努力改进我们的技术，随之我们可能会不时推出新的或优化后的功能，可能需要收集、使用新的个人信息或变更个人信息使用目的或方式。对此，我们将通过更新本政策、弹窗、页面提示等方式另行向您说明对应信息的收集目的、范围及使用方式，并为您提供自主选择同意的方式，且在征得您明示同意后收集、使用。在此过程中，如果您有任何疑问、意见或建议的，您可通过本平台提供的各种联系方式与我们联系，我们会尽快为您作出解答。</p><p><br/></p><p>&nbsp;</p><p><br/></p><p>我们会为实现本政策下述的各项功能，收集和使用您的个人信息：</p><p><br/></p><p>（一） 帮助您注册，并向您提供本平台所提供的服务；</p><p><br/></p><p>1、注册服务</p><p><br/></p><p>我们通过本平台账户为您提供基础会员服务。为注册成为会员并使用我们的会员服务，您在申请注册时需要填写和提供以下信息：</p><p><br/></p><p>（1）身份信息。该信息可以帮助我们验证您是否有资格注册为本平台会员，包括但不限于您的名字、您的居住地址、您所属国家或政府签发的其他具有证明您身份信息的不同的证书以及涉及到的号码及所有其他可帮助我们验证您身份的信息（以下合称为“身份信息” ）。该身份信息具体根据您是个人用户还是机构用户而有所不同，根据不同司法管辖区的法律和法规，我们针对来自不同国家或地区的用户所收集的信息可能有所不同。以下信息和数据作为一个指示性的示例：</p><p><br/></p><p>个人用户：国籍、法定全名（包括曾用名和当地语言名称）、身份证号、电子邮件地址、电话号码、社会安全号码（“SSN”），护照号码或任何政府颁发的身份证号码、出生日期、身份证明（例如护照，驾驶执照或政府颁发的身份证明）。</p><p><br/></p><p>机构用户：公司法定名称（包括当地语言的法定名称）、注册信息、商务电话号码、授权代表及授权用户个人信息、主要营业地点、所有实益拥有人的个人信息）、股东/实益拥有人的身份证明文件（护照或政府签发的身份证）、公司架构、公司成立相关文件、董事会决议、资金来源申报、风险与合规控制说明及平台要求的其他信息或者文件。</p><p><br/></p><p>（2）服务信息。该信息帮助我们与您联系并顺利为您提供不同模式的数字资产间交易服务，包括但不限于您的个人身份信息、联系信息、交易信息、以及您的借记卡信息和/或其他帐户信息（以下合称为“服务信息” ）。同时请您理解，我们向您提供的服务是不断更新和发展的。如您选择使用了前述说明当中尚未涵盖的其他服务，基于该服务我们需要收集您的额外信息的，我们会通过页面提示、交互流程、协议约定、弹窗提示等方式向您说明信息收集的范围与目的，并征得您的同意。</p><p><br/></p><p>如果您仅需使用浏览服务，您不需要注册成为我们的会员及提供上述信息。</p><p><br/></p><p>2、其他注册服务</p><p><br/></p><p>实名认证：当您注册登录后，需进入&quot;个人中心&quot;在身份认证中完成实名认证，您在使用实名认证过程中需向平台提供您的真实姓名、身份证号或护照号。</p><p><br/></p><p>高级认证：当您在本平台中的交易额超过一定限额时，平台为了维护您的资产安全，会要求对您进行高级认证。认证过程除实名认证信息外，您认可平台对您进行“人脸识别”的高级认证，人脸识别会涉及到平台对您的相关视频流或人脸图像的收集。</p><p><br/></p><p>账户信息展示：如果您已拥有本平台账户，我们可能会在服务中显示您的上述个人信息（实名认证仅显示认证是否通过的结果），以及您在平台账户相关联的产品和服务中执行的操作，包括通过本平台账户集中展示您的个人资料、交易订单。我们会尊重您对平台账户设置所做的选择。</p><p><br/></p><p>（二） 安全管理服务和服务信息推送服务</p><p><br/></p><p>当您使用本平台提供的服务或访问本平台时，本平台为保障您的交易安全及服务的安全稳定运行，我们需要自动接收并记录您的Web浏览器信息，您登录账户使用的设备类型、型号版本等设备识别符号等设备信息、您请求访问的网页上的IP地址及记录、所在地区、网络环境、设备指纹信息、服务日志信息、软件信息、位置信息等。</p><p><br/></p><p>请注意，单独的设备信息是无法识别特定自然人身份的信息。如果我们将这类非个人信息与其他信息结合用于识别特定自然人身份，或者将其与个人信息结合使用，则在结合使用期间，这类非个人信息将被视为个人信息，除取得您授权或法律法规另有规定外，我们会将这类信息做匿名化、去标识化处理。</p><p><br/></p><p>为向您提供更便捷、更符合您个性化需求的信息展示及推送服务，我们未来可能会根据您的设备信息和您本平台或客户端的浏览使用信息，提取您的偏好特征，并基于特征标签产出间接人群画像，用于展示、推送信息和可能的商业广告。若您不同意接收此类推送信息或撤回同意收集个人信息，您可根据本政策提供的联系方式与我们联系。</p><p><br/></p><p>我们努力保障您的浏览体验。如果您不想接受我们给您发送的商业广告，您可通过短信提示回复退订或我们提供的其他方式进行退订或关闭。</p><p><br/></p><p>此外，我们也会为了不断改进和优化上述的功能来使用您的上述信息。</p><p><br/></p><p>（三）交易记录保管及查询服务</p><p><br/></p><p>我们就您在本平台上的交易所收集的相关数据，包括但不限于交易记录。如您需查询您的订单交易记录，可在平台“订单管理”中查询您的个人交易明细，具体包括：交易对方昵称、下单时间、订单号、交易信息、数字资产种类及数量等。</p><p><br/></p><p>（四） 客服及争议处理</p><p><br/></p><p>当您与我们联系或提出售中售后、争议纠纷处理申请时，为了保障您的账户及系统安全，我们需要您提供必要的个人信息以核验您的会员身份。</p><p><br/></p><p>为便于与您联系、尽快帮助您解决问题或记录相关问题的处理方案及结果，我们可能会保存您与我们的通信记录及相关内容（包括账号信息、订单信息、您为了证明相关事实提供的其他信息，或您留下的联系方式信息），如果您针对具体订单进行咨询、投诉或提供建议的，我们会使用您的账号信息和订单信息。</p><p><br/></p><p>为了提供服务及改进服务质量的合理需要，我们还可能使用的您的其他信息，包括您与客服联系时您提供的相关信息，您参与问卷调查时向我们发送的问卷答复信息。</p><p><br/></p><p>（五）其他</p><p><br/></p><p>1、若你提供的信息中含有其他用户的个人信息，在向本平台提供这些个人信息之前，您需确保您已经取得合法的授权。若其中涉及儿童个人信息的，您需在发布前取得对应儿童监护人的同意，前述情形下监护人有权通过本政策第九条的途径联系我们，要求更正或删除涉及儿童个人信息的内容。</p><p><br/></p><p>2、若我们将信息用于本政策未载明的其他用途，或者将基于特定目的收集而来的信息用于其他目的，或者我们主动从第三方处获取您的个人信息，均会事先获得您的同意。</p><p><br/></p><p>若我们从第三方处间接获取您的信息的，我们会在收集前明确以书面形式要求该第三方在已依法取得您同意后收集个人信息，并向您告知共享的信息内容，且涉及敏感信息的在提供给我们使用前需经过您的明确确认，要求第三方对个人信息来源的合法性和合规性作出承诺，如第三方有违反行为的，我们会明确要求对方承担相应法律责任；同时，我们对个人信息会进行安全加固（包括敏感信息报备、敏感信息加密存储、访问权限控制等）。我们会使用不低于我们对自身用户个人信息同等的保护手段与措施对间接获取的个人信息进行保护。</p><p><br/></p><p>3、征得授权同意的例外</p><p><br/></p><p>您充分理解并同意，我们在以下情况下收集、使用您的个人信息无需您的授权同意，且我们可能不会响应您提出的更正/修改、删除、注销、撤回同意、索取信息的请求：</p><p><br/></p><p>（1）与国家安全、国防安全有关的；</p><p><br/></p><p>（2）与公共安全、公共卫生、重大公共利益有关的；</p><p><br/></p><p>（3）与犯罪侦查、起诉、审判和判决执行等司法或行政执法有关的；</p><p><br/></p><p>（4）出于维护您或其他个人的生命、财产等重大合法权益但又很难得到本人同意的；</p><p><br/></p><p>（5）您自行向社会公众公开的个人信息；</p><p><br/></p><p>（6）从合法公开披露的信息中收集个人信息的，如合法的新闻报道、政府信息公开等渠道。</p><p><br/></p><p>（7）根据与您签订和履行相关协议或其他书面文件所必需的；</p><p><br/></p><p>（8）用于维护所提供的产品及/或服务的安全稳定运行所必需的，例如发现、处置产品及/或服务的故障；</p><p><br/></p><p>（9）为合法的新闻报道所必需的；</p><p><br/></p><p>（10）学术研究机构基于公共利益开展统计或学术研究所必要，且对外提供学术研究或描述的结果时，对结果中所包含的个人信息进行去标识化处理的；</p><p><br/></p><p>（11）法律法规规定的其他情形。</p><p><br/></p><p>请知悉，根据适用的法律，若我们对个人信息采取技术措施和其他必要措施进行处理，使得数据接收方无法重新识别特定个人且不能复原，或我们可能会对收集的信息进行去标识化地研究、统计分析和预测，用于改善本平台的内容和布局，为商业决策提供产品或服务支撑，以及改进我们的产品和服务（包括使用匿名数据进行机器学习或模型算法训练），则此类处理后数据的使用无需另行向您通知并征得您的同意。</p><p><br/></p><p>4、如我们停止运营本平台产品或服务，我们将及时停止继续收集您个人信息的活动，将停止运营的通知以逐一送达或公告的形式通知您，并对我们所持有的与已关停业务相关的个人信息进行删除或匿名化处理。</p><p><br/></p><p>二、我们如何使用Cookie</p><p><br/></p><p>如果您的浏览器或浏览器附加服务允许，您可修改对Cookie的接受程度或拒绝我们的Cookie。有关详情，请参见 AboutCookies.org。但如果您这么做，在某些情况下可能会影响您安全访问我们的平台，且可能需要在每一次访问我们的平台时更改用户设置。您理解并且同意：</p><p><br/></p><p>1、 当您到访我们平台时, 我们通过cookies使用Google Stats去记录我们的业绩以及核对在线广告的效果。Cookie是发送到您的浏览器上并在您的电脑硬盘驱动器上存储的小量数据。只有当您使用您的电脑进入我们平台时,Cookie才能够被发送到您的电脑硬盘上。</p><p><br/></p><p>2、Cookies常用于记录访问者浏览我们平台上的各个项目时的习惯以及偏好。Cookies所搜集的资料是不记名的集体统计数据, 不载有个人资料。</p><p><br/></p><p>3、Cookies不能用于取得您的硬盘上的数据、您的电邮地址、及您的私人数据，其可使本平台或服务商系统识别到您的浏览器并捕捉和记忆信息。大多数浏览器都预设为可以接受Cookies。您可以选择将您的浏览器设定为不接受Cookies,或如果Cookies一被装上就通知您。不过, 若设定为禁止Cookies, 您或许便不能启动或使用我们平台的某些功能。</p><p><br/></p><p>三、我们如何共享、转让、公开披露您的信息</p><p><br/></p><p>（一）共享</p><p><br/></p><p>&nbsp; &nbsp; &nbsp; 我们不会与本平台服务提供者以外的公司、组织和个人共享您的个人信息，但以下情况除外：</p><p><br/></p><p>1、在法定情形下的共享：我们可能会根据法律法规规定、诉讼、争议解决需要，或按行政、司法机关依法提出的要求，对外共享您的个人信息。</p><p><br/></p><p>2、在获取明确同意的情况下共享：获得您的明确同意后，我们会与其他方共享您的个人信息。</p><p><br/></p><p>3、在您主动选择情况下共享：我们会根据您的选择，将您的订单信息中与交易有关的必要信息共享给数字资产的交易对方，以实现您的交易及售后服务需求。</p><p><br/></p><p>4、与授权合作伙伴共享：我们的关联方、帮助我们经营我们的平台、开展业务、或者向您提供服务的受信任的第三方，只要这些当事方同意将这些信息保密；当我们相信披露的信息是适当的，是遵守法律、法规、规章制度的或来自于法院或他主管当局的命令、执行我们的平台策略，正常运行平台所需要，关联方提供服务所需或保护我们或他人的权利、财产或安全的。</p><p><br/></p><p>（二）转让</p><p><br/></p><p>我们不会将您的个人信息转让给任何公司、组织和个人，但以下情况除外：</p><p><br/></p><p>1、在获取明确同意的情况下转让：获得您的明确同意后，我们会向其他方转让您的个人信息；</p><p><br/></p><p>2、在本平台发生合并、收购或破产清算情形，或其他涉及合并、收购或破产清算情形时，如涉及到个人信息转让，我们会要求新的持有您个人信息的公司、组织继续受本政策的约束，否则我们将要求该公司、组织和个人重新向您征求授权同意。</p><p><br/></p><p>（三）公开披露</p><p><br/></p><p>我们仅会在以下情况下，公开披露您的个人信息：</p><p><br/></p><p>1、获得您明确同意或基于您的主动选择，我们可能会公开披露您的个人信息；</p><p><br/></p><p>2、如果我们确定您出现违反法律法规或严重违反本平台相关协议及规则的情况，或为保护本平台用户或公众的人身财产安全免遭侵害，我们可能依据法律法规或征得您同意的情况下披露关于您的个人信息，包括相关违规行为以及本平台已对您采取的措施。</p><p><br/></p><p>&nbsp; &nbsp; （四）共享、转让、公开披露个人信息时事先征得授权同意的例外</p><p><br/></p><p>以下情形中，共享、转让、公开披露您的个人信息无需事先征得您的授权同意：</p><p><br/></p><p>1、与国家安全、国防安全有关的；</p><p><br/></p><p>2、与公共安全、公共卫生、重大公共利益有关的；</p><p><br/></p><p>3、与犯罪侦查、起诉、审判和判决执行等司法或行政执法有关的；</p><p><br/></p><p>4、出于维护您或其他个人的生命、财产等重大合法权益但又很难得到本人同意的；</p><p><br/></p><p>5、您自行向社会公众公开的个人信息；</p><p><br/></p><p>6、从合法公开披露的信息中收集个人信息的，如合法的新闻报道、政府信息公开等渠道。</p><p><br/></p><p>请知悉，根据适用的法律，若我们对个人信息采取技术措施和其他必要措施进行处理，使得数据接收方无法重新识别特定个人且不能复原，则此类处理后数据的共享、转让、公开披露无需另行向您通知并征得您的同意。</p><p><br/></p><p>&nbsp;四、我们如何保护您的信息</p><p><br/></p><p>1、我们实施妥善的实物、电子、管理及技术方面的措施来保护和保障您的个人资料的安全。我们尽力确保通过我们平台所搜集的任何个人资料皆免于任何与我们无关的第三者的滋扰。我们采取的安全措施包括但不限于：</p><p><br/></p><p>（1）实物措施：存有您个人资料的记录会被存放在有锁的地方。</p><p><br/></p><p>（2）电子措施：存有您个人资料的电脑数据会被存放在受严格登入限制的电脑系统和存储媒体上。</p><p><br/></p><p>（3）管理措施：我们内部设立有对用户信息进行安全保护的相关部门，并建立了相关内控制度，对可能接触到您的信息的工作人员采取严格授权原则，只有经我们授权的职员才能接触到您的个人资料, 这些职员需要遵守我们个人资料保密的内部守则。此外，我们不断对工作人员培训相关法律法规及隐私安全准则和安全意识强化宣导，并定期组织内部相关人员进行应急响应培训和应急演练，使其掌握岗位职责和应急处置策略和规程。</p><p><br/></p><p>（4）技术措施：可能采用如Secure Socket Layer Encryption这种加密技术来输送您的个人资料。</p><p><br/></p><p>（5）安全措施：为保障您的信息安全，我们致力于使用各种现行通用的安全技术及配套的管理体系来尽量降低您的信息被泄露、毁损、误用、非授权访问、非授权披露和更改的风险。例如：通过网络安全层软件（SSL）进行加密传输、信息加密存储、严格限制数据中心的访问。传输和存储个人敏感信息（含个人生物识别信息）时，我们将采用加密、权限控制、去标识化、脱敏化等安全措施。</p><p><br/></p><p>（6）其它措施：定期审查我们的个人资料收集，存储和处理流程; 并根据必要的原则限制我们的员工和供应商对您数据的访问权限，且我们的员工和供应商均需遵守严格的合同保密义务。</p><p><br/></p><p>2、若您知悉我们的平台上有任何安全方面的漏洞, 请马上联系我们, 使我们可以尽快采取妥适的行动。</p><p><br/></p><p>3、尽管实施了上述技术和保安的措施, 我们不能保证资料在互联网上的输送绝对安全, 因此我们不能绝对保证您通过我们平台提供给我们的个人资料在一切时候都是安全的。我们将不定期更新并公开安全风险、个人信息安全影响评估报告等有关内容，您可通过本平台公告方式获得。</p><p><br/></p><p>五、您如何管理您的信息</p><p><br/></p><p>您可以通过以下方式访问及管理您的信息：</p><p><br/></p><p>（一）查询、更正和删除您的信息</p><p><br/></p><p>您有权根据要求获得您的个人资料副本，并确定我们掌握的关于您的信息是否准确并且是最新的。如果您的任何个人数据不准确，您可以要求更新您的信息。您也可以要求删除您的个人资料，但我们可能会在某些情况下拒绝您的删除请求，例如出于法律要求或其他法律目的。有关数据访问，更正或删除请求，您可以通过第八条中的联系方式联系我们。&nbsp;</p><p><br/></p><p>为了响应数据访问，更正或删除请求，我们将验证请求方的身份，以确保他/她在法律上有权提出此类请求。虽然我们的目标是免费回复这些请求，但我们保留在您的请求重复或繁重时向您收取合理费用的权利。&nbsp;</p><p><br/></p><p>（二）改变您授权同意的范围</p><p><br/></p><p>每个业务功能需要一些基本的个人信息才能得以完成（见本隐私权政策“第一部分”）。除此之外，您可以通过第八条中的联系方式联系我们给予或收回您的授权同意。</p><p><br/></p><p>当您收回同意后，我们将不再处理相应的个人信息。但您收回同意的决定，不会影响此前基于您的授权而开展的个人信息处理。</p><p><br/></p><p>（三）注销您的账户</p><p><br/></p><p>您可以通过第八条中的联系方式联系我们来申请注销您的账户；在您主动注销账户之后，我们将停止为您提供产品或服务，根据适用法律的要求删除您的个人信息，或使其匿名化处理。</p><p><br/></p><p>（四）响应您的上述请求</p><p><br/></p><p>为保障安全，您可能需要提供书面请求，或以其他方式证明您的身份。我们可能会先要求您验证自己的身份，然后再处理您的请求。</p><p><br/></p><p>我们将在15天内做出答复。如您不满意，还可以通过我们提供的联系方式发起投诉。</p><p><br/></p><p>对于您合理的请求，我们原则上不收取费用，但对多次重复、超出合理限度的请求，我们将酌情收取一定费用。对于与您的身份不直接关联的信息、无端重复信息，或者需要过多技术手段（例如，需要开发新系统或从根本上改变现行惯例）、给他人合法权益带来风险或者不切实际的请求，我们可能会予以拒绝。</p><p><br/></p><p>在以下情形中，按照法律法规要求，我们将无法响应您的请求：</p><p><br/></p><p>1、与国家安全、国防安全有关的；</p><p><br/></p><p>2、与公共安全、公共卫生、重大公共利益有关的；</p><p><br/></p><p>3、与犯罪侦查、起诉、审判和执行判决等有关的；</p><p><br/></p><p>4、有充分证据表明个人信息主体存在主观恶意或滥用权利的；</p><p><br/></p><p>5、响应您的请求将导致您或其他个人、组织的合法权益受到严重损害的；</p><p><br/></p><p>6、涉及商业秘密的。</p><p><br/></p><p>六、我们如何处理未成年人的信息</p><p><br/></p><p>本平台向儿童开放，如果我们发现或怀疑用户未满14周岁，我们会要求用户关闭其帐户，且不会允许该用户继续使用平台产品或服务。我们会尽快删除有关资料。如果您知道有任何14周岁以下的人使用我们的服务，请通知我们，以便我们采取行动阻止他们获取我们的产品或服务。</p><p><br/></p><p>对于已满14岁但尚未满18周岁的未成年人，我们期望父母或监护人指导未成年人使用我们的服务。我们将根据相关法律法规的规定保护未成年人的信息的保密性及安全性。</p><p><br/></p><p>如您为未成年人，建议请您的父母或监护人阅读本政策，并在征得您父母或监护人同意的前提下使用我们的服务或向我们提供您的信息。对于经父母或监护人同意而收集您的信息的情况，我们只会在受到法律允许、父母或监护人明确同意或者保护您的权益所必要的情况下使用或公开披露此信息。如您的监护人不同意您按照本政策使用我们的服务或向我们提供信息，请您立即终止使用我们的服务并及时通知我们，以便我们采取相应的措施。</p><p><br/></p><p>如您为未成年人的父母或监护人，当您对您所监护的未成年人的信息处理存在疑问时，请通过本政策公布的联系方式联系我们。</p><p><br/></p><p>七、本隐私权政策如何更新</p><p><br/></p><p>我们的隐私权政策可能变更。</p><p><br/></p><p>未经您明确同意，我们不会限制您按照本隐私政策所应享有的权利。我们会在官方渠道上发布对隐私政策所做的任何变更。如果您不同意修订的内容，您应停止立即访问本平台。当隐私政策的更新版本发布，您持续访问本平台显示和表明您同意该更新的内容，并同意遵守该更新的隐私政策。</p><p><br/></p><p>对于重大变更，我们还会提供更为显著的通知（包括我们会通过本平台公示的方式进行通知甚至向您提供弹窗提示）。</p><p><br/></p><p>本政策所指的重大变更包括但不限于：</p><p><br/></p><p>1、我们的服务模式发生重大变化。如处理个人信息的目的、处理的个人信息类型、个人信息的使用方式等；</p><p><br/></p><p>2、我们在控制权等方面发生重大变化。如并购重组等引起的信息控制者变更等；</p><p><br/></p><p>3、个人信息共享、转让或公开披露的主要对象发生变化；</p><p><br/></p><p>4、您参与个人信息处理方面的权利及其行使方式发生重大变化；</p><p><br/></p><p>5、我们负责处理个人信息安全的责任部门、联络方式及投诉渠道发生变化；</p><p><br/></p><p>6、个人信息安全影响评估报告表明存在高风险。&nbsp;</p><p><br/></p><p>八、如何联系我们</p><p><br/></p><p>1、如果您有任何要求和意见，您可以通过电子邮件upbit@foxmail.com，这是属于我们与您沟通的唯一有效和官方电子邮件，所以我们对您未使用有效的联系方式，任何作为或不作为不承担责任。</p><p><br/></p><p>2、我们只通过本平台上的有效的联系方式发布公告和信息或在本平台张贴公告，所以我们对由于您信任了未通过以上方式获得的信息而产生的任何损失不承担责任。</p><p><br/></p><p>3、若您对我们的隐私政策有任何问题, 欢迎随时联系我们。</p><p><br/></p>',0,1509033600,1509033600,'http://lequ4.m88mo.cn/images/zwtp.png','https://www.COINYMH.cc/images/zwtp.png',96),(63,19,'zh','法律声明',0,0,0,0,'管理员',0,'法律声明','法律声明','<p>第一条&nbsp;</p><p>本网站的宗旨是在不违反韩国相关法律法规的前提下，尽可能地为全球广大数字资产爱好者及用户提供专业、安全、可信赖的数字资产交易及资产管理服务。但您所在国家或地区属于监管明确禁止数字资产交易的法域或属于被列入相关受制裁国家名单的，您应禁止使用本网站项下的服务。</p><p>第二条&nbsp;</p><p>本平台致力于为用户创建一个合规、安全、可靠的数字资产交易环境，禁止用户使用本网站从事洗钱、走私、商业贿赂、恶意操纵市场等一切非法交易活动或违法行为。为此我们尽最大努力制定严格的反洗钱反恐怖方案及采取有效的安全风险控制措施，以最大限度地保障用户的合法权益，并使平台自身维持着一个良好的品牌声誉。</p><p>第三条&nbsp;</p><p>当有权机关出示相应的调查文件要求本网站配合对指定用户进行调查时， 或对用户账户采取查封、冻结或者划转等措施时，本网站将在核查司法文件的有效性和真实性后，按照经平台判定的有权机关的要求协助提供相应的用户数据，或进行相应的操作，因此造成的用户隐私泄露、账户不能操作及由此给用户所造成的其他损失等，本网站不承担任何责任。</p><p>第四条&nbsp;</p><p>凡使用本网站服务的用户，在交易前均应知悉：数字资产不以任何政府或中央银行为后盾支持，且数字资产价格波动大，持有或使用数字资产具有较高的风险。在作出交易决策前，您应理性审慎自身的财务状况以判断是否适合您。</p><p>第五条</p><p>本网站使用者因为违反本声明的规定而触犯韩国相关法律的，本网站作为服务的提供方，有义务对平台的规则及服务进行完善， 但本站并无触犯韩国相关法律的动机和事实，对使用者的行为不承担任何连带责任。</p><p>第六条</p><p>凡以任何方式登录本网站或直接、间接使用本网站服务者，视为自愿接受本网站声明的约束。</p><p>第七条</p><p>本声明未涉及的问题参见韩国有关法律法规，当本声明与韩国相关法律法规冲突时，以韩国相关法律法规为准。</p><p><br/></p>',0,1509033600,1509033600,'http://lequ4.m88mo.cn/images/zwtp.png','https://www.COINYMH.cc/images/zwtp.png',97),(66,19,'zh','关于反洗钱',0,0,0,0,'管理员',0,'关于反洗钱','关于反洗钱','<p>&nbsp;</p><p>《Upbit Rok. OTC平台反洗钱和反恐怖融资用户指引》</p><p>&nbsp;</p><p><br/></p><p>第一条：制定的目的和依据 鉴于洗钱活动将严重危害数字资产交易的发展，助长和滋生腐败、败坏社会风气，损害用户的正当权益，破坏数字资产交易平台稳健经营的基础，加大数字资产交易平台的法律和运营风险，Upbit Rok为预防洗钱和恐怖融资活动，全面履行反洗钱和反恐融资法律的相关规定，根据《Upbit Rok反洗钱规则》、《客户协议》、《大额交易管理办法》等公司规定，制定本指引。</p><p><br/></p><p>第二条：适用范围 本指引适用于在Upbit Rok OTC平台（以下简称“OTC平台”）交易的所有用户。用户应当在遵循其所在地国家或地区反洗钱和反恐融资方面的法律规定，在用户所在地区法律规定的范围内，执行本指引之规定。用户所在国家或者地区有更严格要求的，遵守其规定。</p><p><br/></p><p>第三条：反洗钱和反恐怖融资 是指为了防范不法分子通过OTC平台进行交易从而掩饰、隐瞒毒品犯罪、黑社会性质的组织犯罪、恐怖活动犯罪、走私犯罪、贪污贿赂犯罪、金融诈骗犯罪、破坏金融管理秩序犯罪等违法所得及其收益的来源和性质的洗钱活动，依照相关法律和Upbit Rok反洗钱相关规定采取相关措施的行为。</p><p><br/></p><p>第四条：Upbit Rok反洗钱相关规定 Upbit Rok的反洗钱（包括反恐怖融资，下同）相关规则包括《Upbit Rok反洗钱规则》、《用户协议》中反洗钱的部分、《大额交易管理办法》与本指引。若本指引中规定的内容与其它规则相冲突，则本指引优先适用。</p><p><br/></p><p>第五条：OTC平台反洗钱基本原则 OTC平台按照以下原则开展客户风险监控工作：</p><p><br/></p><p>·&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;全面性原则。OTC平台会综合考虑客户可能涉嫌洗钱的各类风险因素，采取合理方式对所有客户进行风险监控。</p><p><br/></p><p>·&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;审慎性原则。OTC平台会在充分了解客户的基础上，提高对客户身份的识别能力，审慎进行客户风险监控。</p><p><br/></p><p>·&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;持续性原则。OTC平台会对客户风险进行持续关注，根据实际情况适做出应对。</p><p><br/></p><p>·&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;保密性原则。OTC平台所掌握的客户身份信息、交易信息和风险等级信息等予以严格保密，非依法律规定和监管要求，不会向任何单位和个人提供。</p><p><br/></p><p>·&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;分级管理原则。OTC平台根据客户的风险等级，定期审核所保存的客户基本信息，对风险等级较高客户的审核应当严于对风险等级较低客户的审核。</p><p><br/></p><p>第六条：个人用户文件之提交 OTC个人用户应当依据Upbit Rok反洗钱相关规定提交以下信息和资料：</p><p><br/></p><p>·&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;个人姓名；</p><p><br/></p><p>·&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;身份证或护照复印件；</p><p><br/></p><p>·&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;其它应OTC要求应当提供之信息或文件。</p><p><br/></p><p>第七条：机构用户文件之提交 OTC机构用户应当依据DF.One反洗钱相关规定提交以下信息和资料：</p><p><br/></p><p>·&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;公司名称；</p><p><br/></p><p>·&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;公司注册办公地址；</p><p><br/></p><p>·&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;公司法定代表人；</p><p><br/></p><p>·&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;公司法定代表人住所地；</p><p><br/></p><p>·&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;公司营业执照；</p><p><br/></p><p>·&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;公司法定代表人身份证或护照复印件；</p><p><br/></p><p>·&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;其它应OTC要求应当提供之信息或文件。</p><p><br/></p><p>第八条：用户文件之审查 OTC平台会依据Upbit Rok反洗钱相关规定中的客户识别制度对客户所提交的相关信息进行核实和记录，若OTC平台对于客户所提交的资料有疑问时，有权向相关主管机构或部门进行核实。</p><p><br/></p><p>第九条：低风险用户之监测 OTC平台会根据Upbit Rok反洗钱规定的具体要求对低风险用户进行检测，OTC平台保留对低风险用户进行调级的权利。</p><p><br/></p><p>第十条：高风险用户之监测 OTC平台对于高风险类别的客户，会于每半年进行一次审核，更新客户身份基本信息并了解其资金来源、资金用途、经济状况或者经营状况等信息。</p><p><br/></p><p>第十一条：用户文件之保存 OTC平台会依法采取必要措施将客户身份资料和交易信息保存一定期限。参照国际通行规则，用户身份资料自业务关系结束后，客户交易信息自交易结束后，应至少保存五年。</p><p><br/></p><p>第十二条：用户之注意 OTC用户应当注意以下事项：</p><p><br/></p><p>·&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;禁止将用户本人的账号出借给他人使用；</p><p><br/></p><p>·&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;禁止出租、出借用户本人身份证件；</p><p><br/></p><p>·&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;禁止出租、出借、透露用户本人的账户、银行卡、存折、密码等重要个人财产信息；</p><p><br/></p><p>·&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;用户应当主动配合OTC平台进行客户身份识别；</p><p><br/></p><p>·&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;在OTC平台进行交易时，选择并使用安全可靠的第三方金融机构进行支付活动。</p><p><br/></p><p>第十三条：可疑行为之报告 若OTC平台用户在平台交易时发现任何账户可能从事洗钱或恐怖融资活动，用户可以向OTC平台进行报告。</p><p><br/></p><p>第十四条：指引之解释 本指引由OTC平台进行解释。</p><p><br/></p><p>第十五条：生效期 本指引自发布之日起实施。</p><p><br/></p>',0,1509379200,1509379200,'http://lequ4.m88mo.cn/images/zwtp.png','https://www.COINYMH.cc/images/zwtp.png',98),(111,19,'zh','提币操作风险告知书',0,0,0,0,'管理员',0,'提币操作风险告知书','提币操作风险告知书','<p>尊敬的用户：</p><p><br/></p><p>提币操作属于资产转移的风险行为，在您做出提币操作前，请您仔细阅读本风险提示告知书，全面认识提币操作的可能风险，知悉本服务存在的各项风险因素，并充分考虑自身的风险意识、风险识别能力和风险承受能力，谨慎做出接受服务的决策。</p><p><br/></p><p>本服务提示书一经您确认，即视为您已详细阅读并理解本风险提示告知书的全部内容，自愿接受upbit的提币服务；即视为您对提币的风险均有足够的认识、并自愿承担操作提币可能面临的风险及法律责任。</p><p><br/></p><p>现Upbit Rok做出如下风险提示告知及声明：</p><p><br/></p><p>1.&nbsp; &nbsp; &nbsp; 资产归属变更: 一旦提币至其他平台或地址，此资产将由提币地址的个人/平台掌控；</p><p><br/></p><p>2.&nbsp; &nbsp; &nbsp; 平台无法追回：提币一旦完成，平台将无法协助您追回该提币资产；</p><p><br/></p><p>3.&nbsp; &nbsp; &nbsp; 提币至不可信平台造成资产损失：受他人利诱，提币至资金盘/传销盘等不可信平台，造成币无法再从该平台提出；</p><p><br/></p><p>4.&nbsp; &nbsp; &nbsp; 被人诈骗提币：受他人套利、空投等利诱，提币至某赌博网站、杀猪盘诈骗平台等，造成资产损失；</p><p><br/></p><p>5.&nbsp; &nbsp; &nbsp; 借贷不归还：因借贷关系，提币至他人地址，结果此人不再归还，造成资产损失；</p><p><br/></p><p>6.&nbsp; &nbsp; &nbsp; 涉及洗钱风险：受他人委托或利诱，协助他人买币后提币，涉及参与洗钱行为，造成协助他人犯罪，导致个人被司法追责；</p><p><br/></p><p>7.&nbsp; &nbsp; &nbsp; 地址错误：因个人填写错误，提币至错误地址，导致资产无法追回。</p><p><br/></p><p>8.&nbsp; &nbsp; &nbsp; 参与ICO风险：ICO众筹属于高风险投资行为，请谨慎判断，另请不要直接提币到ICO的众筹地址，这会导致您无法收取众筹到的数字资产。</p><p><br/></p><p>9.&nbsp; &nbsp; &nbsp; 不可抗因素导致的风险：包括但不限于战争、金融市场危机、自然灾害、重大政治事件、黑客攻击、电脑病毒爆发等不能避免、不可克服的不可抗力事件，以及其他不可预测或其他可能导致提币操作造成损失的任何风险。对于由不可抗力及意外事件风险导致的任何损失，用户须自行承担；</p><p><br/></p><p>10.&nbsp; 因用户过错导致的任何损失：该过错包括但不限于：决策失误、操作不当、遗忘或泄露密码、密码被他人破解、个人使用的计算机系统被第三方侵入、委托他人代理交易时他人恶意或不当操作而造成的损失。</p><p><br/></p><p>特别提醒：本风险提示告知书并不保证提示提币操作的全部风险，用户通过upbit操作提币前，应全面了解相关政策法规，认真阅读本平台的相关服务协议，并根据自身的相关情况审慎考虑自身交易风险承受能力。</p><p><br/></p><p>您承诺并保证已认真阅读本风险提示告知书，理解知悉以上所提示的所有风险，并自愿承担由此给您造成的损失。</p><p><br/></p><p>特别提示！</p><p><br/></p>',0,1511971200,1511971200,'http://uinfinance.com/images/zwtp.png','http://uinfinance.com/images/zwtp.png',94),(112,19,'zh','用户协议',0,0,0,0,'管理员',0,'用户协议','用户协议','<p>Upbit Rok（以下称 “公司”）是一家根据韩国相关法律在韩国注册成立的公司，该公司运营网站 www.upbit1.cc（以下称“本网站”或“网站”），该网站是一个专门供用户进行数字资产交易和提供相关服务（以下称“该服务”或“服务”）的平台。为了本协议表述之方便，公司和该网站在本协议中合称使用“我们”或其他第一人称称呼。只要登陆该网站的自然人或其他主体均为本网站的用户，本协议表述之便利，以下使用“您”或其他第二人称。为了本协议表述之便利，我们和您在本协议中合称为“双方”，我们或您单称为“一方”。本网站所有内容，为便利用户，可能提供多个语言版本，若有冲突或遗漏等情况，以中文内容为准。</p><p>重要提示：</p><p>我们在此特别提醒您：</p><p>• 1 数字资产本身不由任何金融机构或公司或本网站发行；</p><p>• 2 数字资产市场是全新的、未经确认的，而且可能不会增长；</p><p>• 3 数字资产主要由投机者大量使用，零售和商业市场使用相对较少，数字资产交易存在极高风险，其全天不间断交易，没有涨跌限制，价格容易受庄家、全球政府政策的影响而大幅波动；</p><p>• 4 如果公司根据其单方判断认为您违反了本协议，或者根据您所在管辖区域的法律本网站提供的服务或者您使用本网站提供的服务的行为是非法的，公司有权随时暂停或终止您的账户，或者暂停或终止您使用本网站提供的服务或数字资产交易。&nbsp;</p><p><br/></p><p>数字资产交易有极高风险，并不适合绝大部分人士。您了解和理解此交易有可能导致部分损失或全部损失，所以您应该以能承受的损失程度来决定交易的金额。您了解和理解数字资产会产生衍生风险，所以如有任何疑问，建议先寻求专业顾问的协助。此外，除了上述提及过的风险以外，还会有未能预测的风险存在。您应慎重考虑并用清晰的判断能力去评估自己的财政状况及上述各项风险而作出任何买卖数字资产的决定，并承担由此产生的全部损失，我们对此不承担任何责任。</p><p>敬告您：</p><p>• 1 您了解本网站仅作为您获取数字资产信息、寻找交易方、就数字资产的交易进行协商及开展交易的场所，本网站不参与您的任何交易，故您应自行谨慎判断确定相关数字资产及/或信息的真实性、合法性和有效性，并自行承担因此产生的责任与损失。</p><p>• 2 本网站的任何意见、消息、探讨、分析、价格、建议和其他资讯均是一般的市场评论，并不构成投资建议。我们不承担任何因依赖该资讯直接或间接而产生的损失，包括但不限于任何利润损失。</p><p>• 3 本网站的内容会随时更改并不作另行通知，我们已采取合理措施确保网站资讯的准确性，但并不能保证其准确性程度，亦不会承担任何因本网站上的资讯或因未能链结互联网、传送或接收任何通知和信息时的延误或失败而直接或间接产生的损失。</p><p>• 4 使用互联网形式的交易系统亦存有风险，包括但不限于软件，硬件和互联网链结的失败等。由于我们不能控制互联网的可靠性和可用性，我们不会对失真，延误和链结失败而承担任何责任。</p><p>• 5 www.upbit1.cc为本网站唯一官方对外信息公布平台；</p><p>• 6 禁止使用本网站从事洗钱、走私、商业贿赂等一切非法交易活动或违法行为，若发现任何涉嫌非法交易或违法行为，本站将采取各种可使用之手段，包括但不限于冻结账户，通知相关权力机关等，我们不承担由此产生的所有责任并保留向相关人士追究责任的权利。</p><p>• 7 禁止使用本网站进行恶意操纵市场、不正当交易等一切不道德交易活动，若发现此类事件，本网站将对所有恶意操纵价格、恶意影响交易系统等不道德的行为采取警告、限制交易、关停账户等预防性的保护措施，我们不承担由此产生的所有责任并保留向相关人士追究责任的权利。</p><p>一、总则</p><p>• 1.1 《用户协议》（以下称“本协议”或“本条款及条件”），由正文、《隐私条款》、《了解你的客户和反洗钱政策》以及本网站已经发布的或将来可能发布的各类规则、声明、说明等构成。</p><p>• 1.2 您在使用本网站提供的各项服务之前，应仔细阅读本协议，如有不理解之处或其他必要，请咨询专业律师。如您不同意本协议及/或随时对其的修改，请您立即停止使用本网站提供的服务或不再登陆本网站。您一旦登陆本网站、使用本网站的任何服务或任何其他类似行为即表示您已了解并完全同意本协议各项内容，包括本网站对本协议随时所做的任何修改。</p><p>• 1.3 您通过按照本网站的要求填写相关信息，并经过其他相关程序后成功注册可以成为本网站的会员（以下称“会员”），在进行注册过程中点击“同意”按钮即表示您以电子签署的形式与公司达成协议；或您在使用本网站过程中点击任何标有“同意”或