，对本网站和您均具有约束力。</p><p>• 20.2 本协议的最终解释权归本网站所有。</p><p> </p><p>了解你的客户和反洗钱政策</p><p>一、导言</p><p>• 1.1我们保证审慎遵守“了解你的客户”和反洗钱相关的法律法规且不得故意违反该《了解你的客户和反洗钱政策》。在我们合理控制的范围内我们将采取必要的措施和技术为您提供安全的服务，尽可能使您免于遭受犯罪嫌疑人的洗钱行为带来的损失。</p><p>• 1.2我们的了解你的客户和反洗钱政策是一个综合性的国际政策体系，包括您隶属的不同法律辖区的了解你的客户和反洗钱政策。</p><p>二、了解你的客户和反洗钱政策如下：</p><p>• 2.1颁布了解你的客户和反洗钱政策并时时更新以满足相应的法律法规规定的标准；</p><p>• 2.2颁布和更新运行本网站的一些指导原则和规则，且我们的员工将按照该原则和规则的指导提供服务；</p><p>• 2.3 设计并完成内部监测和控制交易的程序，如以严格的手段验证身份，安排组建专业团队专门负责反洗钱工作；</p><p>• 2.4 采用风险预防的方法对客户进行尽职调查和持续的监督;</p><p>• 2.5 审查和定期检查已发生的交易;</p><p>• 2.6 向主管当局报告可疑交易;</p><p>• 2.7身份证明文件、地址证明文件和交易记录的证明文件将会维持至少六年，如被提交给监管部门，恕不另行通知您。</p><p>三、身份信息与核实确认</p><p>• 3.1 身份信息</p><p>o 3.1.1 根据不同的司法管辖区的不同规定及不同的实体类型，我们收集的您的信息内容可能不一致，原则上将向注册的个人收集以下信息：</p><p>o 个人基本信息：您的姓名，住址（及永久地址，如果不同） ，出生日期及国籍等可获得的其他情况。身份验证应该是根据官方或其他类似权威机构发放的文件，比如护照，身份证或其他不同的辖区要求的和引发的身份证明文件。您提供的地址将使用适当的方法进行验证，比如检查乘用交通工具的票据或利率票据或检查选民登记册等。</p><p>o 有效的照片：在您注册之前，您须提供您将您的身份证件放在胸前的照片；</p><p>o 联系方式：电话/手机号码和/或有效的电子邮件地址。</p><p>o 3.1.2如果您是一个公司或其他合法实体，我们将收集以下信息以确定您或信托帐户的最终受益人。</p><p>o 公司注册、登记证；公司的章程与备忘录副本；公司的股权机构和所有权说明的详细证明材料，证明决定本网站账户的开立以及执行的授权委托人的董事会决议；按照要求需要提供的公司董事、大股东及本网站账户有权签字人的身份证明文件；该公司的主要营业地址，如果与公司的邮寄地址不同，提供邮寄地址。如果公司在本地的地址与它的主要营业地址不一致的，则被视为风险较高的客户，需要提交额外附加文件。</p><p>o •根据不同的司法管辖区的不同规定及不同的实体类型，我们要求的其他认证和权威部门发布的文件以及我们认为必要的文件。</p><p>o 3.1.3 我们只接受英语版本或汉语版本的身份信息，如不是，请您将您的身份信息翻译成英文的版本并加以公证。</p><p>• 3.2确认核实</p><p>o 3.2.1我们要求您提供身份证明文件的全部页面内容。</p><p>o 3.2.2 我们要求您提供您将您的身份证明文件放在您胸前的照片。</p><p>o 3.2.3证明文件的副本一般应核和原始凭证进行核对。然而，如果某个可信赖的合适的认证人可证明该副本文件是原始文件准确而全面的复制的，该副本可接受。这样的认证人包括大使、司法委员、地方治安官等。</p><p>o 3.2.4 对识别最终受益人和账户控制权的要求是确定哪些个人最终所有或控制直接客户，和/或确定正在进行的交易是由他人代为执行。如果是企业，则大股东的身份（例如那些持有10％或以上的投票权益）应被验证。一般，持股25 ％会被认定为正常风险内，其股东身份须验证；持股10%或拥有更多的投票权或股票时被认定为高风险的情况，股东身份须加以验证。</p><p>四、监控交易</p><p>• 4.1 我们根据安全性和实际交易情况时时设置和调整日常交易和提币最高限额;</p><p>• 4.2如果交易频繁集中发生在某个注册用户或存在超乎合理的情况，我们的专业团队将评估并决定他们是否可疑;</p><p>• 4.3我们凭借自身的判断认定为可疑交易的情况，我们可能会采取暂停该交易、拒绝该交易等限制性措施，甚至如果可能将尽快逆转该交易，同时向主管部门报告，但不会通知您;</p><p>• 4.4我们保留拒绝来自于不符合国际反洗钱标准辖区的人或可被视为政治公众人物的人的注册申请，我们保留随时暂停或终止根据我们自身判断为可疑交易的交易，但我们这样做并不违反对您的任何义务和责任。</p><p><br/></p>',0,1539532800,1615056423,'http://129.226.121.225/images/zwtp.png','http://129.226.121.225/images/zwtp.png',0),(141,29,'zh','用户协议',0,0,0,0,'管理员',0,'用户协议','','<p><br/></p><p>Upbit是融科技公司Dunamu与美国国际站Bittrex合作推出的数字货币国际站，2017年10月月底上线，目前支持来100多个交易对，超过110种代币的交易。Dunamu预计Upbit将成为韩国最大的数字货币国际站，平台在未来还会逐步上架更多新的数字货币。该公司运营网站www.upbit1.cc（以下称“本网站”或“网站”）是一个提供区块链产业服务（以下称“该服务”或“服务”）的平台。为了保障您的权益，请于注册或使用本网站前，仔细阅读并完全理解本协议条款的全部内容。</p><p><br/></p><p>一、总则</p><p><br/></p><p>1.1 《用户协议》（以下称“本协议”），由正文、《隐私条款》以及本网站已经发布的或将来可能发布的各类规则、声明、说明等构成。</p><p><br/></p><p>1.2 您在使用本网站提供的各项服务之前，应仔细阅读本协议，如有不理解之处或其他必要，请咨询专业律师。如您不同意本协议及/或随时对其的修改，请您立即停止使用本网站提供的服务或不再登陆本网站。您一旦登陆本网站、使用本网站的任何服务或任何其他类似行为即表示您已了解并完全同意本协议各项内容，包括本网站对本协议随时所做的任何修改</p><p><br/></p><p>1.3 您通过按照本网站的要求填写相关信息，并经过其他相关程序后成功注册可以成为本网站的用户（以下称“用户”），在进行注册过程中点击“同意”按钮即表示您以电子签署的形式与公司达成协议；或您在使用本网站过程中点击任何标有“同意”或类似意思的按钮的行为或以其他本网站允许的方式实际使用本网站提供的服务时，均表示您完全了解、同意且接受本协议项下的全部条款的约束，就本协议而言，无您手写的书面签字对您的法律约束力无任何影响。</p><p><br/></p><p>1.4 您成为本网站的用户后，您将获得一个用户帐号及相应的密码，该用户帐号和密码由用户负责保管；您应当对以您帐号进行的所有活动和事件负法律责任。</p><p><br/></p><p>1.5 只有成为本网站的用户才可使用本网站提供的区块链产业服务；非注册用户只可以浏览网站内容。</p><p><br/></p><p>1.6 通过注册和使用任何由本网站提供的服务和功能，您将被视为已阅读，理解并：</p><p><br/></p><p>1.6.1 接受本协议所有条款及条件的约束；</p><p><br/></p><p>1.6.2 您确认您已年满18周岁或根据不同的可适用的法律规定的具有可订立合同的法定年龄，您在本网站的注册、发布信息等接受本网站服务的行为应当符合对您有管辖权的主权国家或地区相关法律法规，并有充分的能力接受这些条款；</p><p><br/></p><p>1.6.3 您确认注册时提供的信息是真实和准确的；</p><p><br/></p><p>1.6.4 您同意您为您自身的交易或非交易行为承担全部责任和任何收益或亏损。</p><p><br/></p><p>1.6.5 您确认注册时提供的信息是真实和准确的。</p><p><br/></p><p>1.6.6 您同意遵守任何有关法律的规定；</p><p><br/></p><p>1.6.7 您同意在任何时候不得从事或参与损害本网站的行为或活动，无论是否与本网站提供的服务有关。</p><p><br/></p><p>1.6.8 本协议只是就您与upbit之间达成的权利义务关系进行约束，而并不涉及本网站用户之间与其他网站和您之间产生的法律关系及法律纠纷。</p><p><br/></p><p>二、协议修订</p><p><br/></p><p>2.1 upbit保留不时修订本协议、并以网站公示的方式进行公告、不再单独通知您的权利，变更后的协议一经在网站公布，立即自动生效。您应不时浏览及关注本协议的更新变更时间及更新内容，如您不同意相关变更，应当立即停止使用本网站服务；您继续使用本网站服务，即表示您接受并同意经修订的协议的约束。</p><p><br/></p><p>三、注册</p><p><br/></p><p>3.1 注册资格</p><p><br/></p><p>您确认并承诺：在您完成注册程序或以其他本网站允许的方式实际使用本网站提供的服务时，您应当是具备可适用的法律规定的可签署本协议及使用本网站