; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 隐私条款</p><p>一、双方</p><p><br/></p><p>1 Tebi Global Ltd.（以下称 “公司”）是一家根据美利坚共和国相关法律在美利坚共和国注册成立的公司，该公司运营网站Tebiglobal.com（以下称“本网站”或“网站”），该网站是一个专门供用户进行数字资产交易和提供相关服务（以下称“该服务”或“服务”）的平台。为了本协议表述之方便，公司和该网站在本协议中合称使用“我们”或其他第一人称称呼。</p><p><br/></p><p>2 只要登陆该网站的自然人或其他主体均为本网站的用户，本协议表述之便利，以下使用“您”或其他第二人称。</p><p><br/></p><p>3 为了本协议表述之便利，我们和您在本协议中合称为“双方”，我们或您单称为“一方”。</p><p><br/></p><p>二、隐私政策制定的目的</p><p><br/></p><p>隐私政策规定了我们只通过您登陆本网站、在本网站上注册和/或使用我们提供的服务采集您信息的类型以及我们如何使用、保护、存储和对外提供这些采集到的信息。</p><p><br/></p><p>三、您的同意</p><p><br/></p><p>为确保您对我们在处理个人资料上有充分信心, 您切要详细阅读及理解隐私政策的条文。特别是您一旦登陆我们的网站，不论您是否在该网站上注册，您均向我们表明您接受、同意、承诺和确认：</p><p><br/></p><p>1 您在自愿下连同所需的同意向我们披露个人资料；</p><p><br/></p><p>2 您会遵守本隐私政策的全部条款和限制；</p><p><br/></p><p>3 您同意我们通过您登陆本网站、在本网站上注册和/或使用我们提供的服务收集您的信息；您同意日后我们对隐私政策的任何修改；</p><p><br/></p><p>4 您同意我们的分公司、附属公司、雇员就您可能会感兴趣的产品和服务与您联络( 除非您已经表示不想收到该等讯息 )。</p><p><br/></p><p>四、收集的信息</p><p><br/></p><p>1 当您使用本网站时，您同意我们开始使用cookies来追踪您的每一个动作，并收集和记住您留下的所有信息，其中包括但不限于您的IP地址，地理位置及其他资料。</p><p><br/></p><p>2 如果您愿意使用本网站提供的不同模式的数字资产间的交易服务，您在申请注册时需要填写和提供以下两种信息：</p><p><br/></p><p>2.1 身份信息。该信息可以帮助我们验证您是否有资格注册为本网站会员，包括但不限于您的名字、您的居住地址、邮寄地址、您所属国家或政府签发的其他具有证明您身份信息的不同的证书以及涉及到的号码及所有其他可帮助我们验证您身份的信息（以下合称为“身份信息” ）。该身份信息具体根据您是个人用户还是机构用户而有所不同，根据不同司法管辖区的法律和法规，平台针对来自不同国家或地区的用户所收集的信息可能有所不同。以下信息和数据作为一个指示性的示例：个人用户：国籍、法定全名（包括曾用名和当地语言名称）、身份证号、电子邮件地址、电话号码、社会安全号码（“SSN”），护照号码或任何政府颁发的身份证号码、出生日期、身份证明（例如护照，驾驶执照或政府颁发的身份证明）、在平台注册日前六个月内拍摄的用户个人照片及平台要求的其他信息或者文件。机构用户：公司法定名称（包括当地语言的法定名称）、注册信息、商务电话号码、授权代表及授权用户个人信息、主要营业地点、所有实益拥有人的个人信息）、持有25%或更多股份的股东/实益拥有人的身份证明文件（护照或政府签发的身份证）、公司架构、公司成立相关文件、董事会决议、资金来源申报、风险与合规控制说明及平台要求的其他信息或者文件。</p><p><br/></p><p>2.2 服务信息。该信息帮助我们与您联系并顺利为您提供不同模式的数字资产间交易服务，包括但不限于您的个人身份信息、联系信息、交易信息、以及您的借记卡信息和/或其他帐户信息（以下合 称为“服务信息” ）。同时请您理解，我们向您提供的服务是不断更新和发展的。如您选择使用了前述说明当中尚未涵盖的其他服务，基于该服务我们需要收集您的额外信息的，我们会通过页面提示、交互流程、协议约定、弹窗提示的方式向您说明信息收集的范围与目的，并征得您的同意。</p><p><br/></p><p>3 安全管理。 当您使用本网站提供的服务或访问本网站时，本网站为保障您的交易安全及服务的安全稳定运行，我们需要自动接收并记录您的Web浏览器信息，您登录账户使用的设备类型、型号版本等设备识别符号等设备信息、您请求访问的网页上的IP地址及记录、所在地区、网络环境、设备指纹信息、服务日志信息、软件信息、位置信息等。</p><p><br/></p><p>4 在您使用本网站或其提供的服务时，我们可能会为了改进本网站的使用功能，提升您对使用本网站及其提供的服务及其安全性的体验或是根据法院或可适用法律法规或有管辖权的其他政府机构的命令，通过本网站公示的专属于我们的邮箱或其他我们认为合规的方式收集更多的必要的信息。</p><p><br/></p><p>5 如果您访问了在本网站上的其他第三方网站或合作的第三方的任何链接，您应同意并遵守该第三方网单独和独立的隐私政策。我们对这些网站或合作方的内容及活动不承担任何责任。</p><p><br/></p><p>五、Cookies</p><p>1 当您到访我们网站时, 我们通过cookies使用Google Stats去记录我们的业绩以及核对在线广告的效果。Cookie是发送到您的浏览器上并在您的电脑硬盘驱动器上存储的小量数据。只有当您使用您的电脑进入我们网站时,Cookie才能够被发送到您的电脑硬盘上。</p><p><br/></p><p>2 Cookies常用于记录访问者浏览我们网站上的各个项目时的习惯以及偏好。Cookies所搜集的资料是不记名的集体统计数据, 不载有个人资料。</p><p><br/></p><p>3 Cookies不能用于取得您的硬盘上的数据、您的电邮地址、及您的私人数据，其可使本网站或服务商系统识别到您的浏览器并捕捉和记忆信息。大多数浏览器都预设为可以接受Cookies。您可以选择将您的浏览器设定为不接受Cookies,或如果Cookies一被装上就通知您。不过, 若设定为禁止Cookies, 您或许便不能启动或使用我们网站的某些功能。</p><p><br/></p><p>六、信息使用</p><p><br/></p><p>1 我们为了以下目的或以下列方式使用我们收集到的您的信息：</p><p><br/></p><p>1.1 处理您的注册，并向您提供本网站所提供的服务；</p><p><br/></p><p>1.2 向您通知我们服务的任何变化；</p><p><br/></p><p>1.3 根据有关主权国家或地区主管当局的要求，向有关监管部门报告；</p><p>1.4 当您使用本网站提供的服务时，本网站将您的信息用于合法目的，例如身份认证、客户服务、安全、欺诈监控、营销及促销、存档和备份，或与第三方联合推广本网站，以确保本网站向您提供的产品和服务的安全性；</p><p><br/></p><p>1.5 收集和处理信息，以帮助本网站设计新的产品和服务，并改进本网站提供的现有服务；</p><p><br/></p><p>1.6 为了使您能够了解本网站提供的服务的具体内容，您同意允许本网站会不定时向您发送与您分享相关的营销活动信息（公司新闻、促销信息以及由Huobi提供的有关产品和服务的信息）、商业电子信息和广告，以取代通用的、全面投放的广告；</p><p><br/></p><p>1.7 邀请您参加与本网站提供的服务有关的调查；</p><p><br/></p><p>1.8 与政府机构、公共事务机构、协会等合作的数据分析；</p><p><br/></p><p>1.9 处理记帐和收取任何费用；</p><p><br/></p><p>1.10个性化您的体验（您的信息将帮助我们更好地为您的个性化需求作出回应）；</p><p><br/></p><p>1.11我们已采用国际标准以防止洗钱、恐怖融资、规避贸易及经济制裁的行为，当最终的虚拟资产条款和规则生效时，我们都会执行，这要求我们对客户进行尽职调查。这可能包括使用第三方数据和服务提供商将您的个人信息与其数据交叉比对。</p><p><br/></p><p>1.12用于所有其他合法用途以及您授权的其他用途。</p><p><br/></p><p>2 我们不会向其他方出售、交易或以其他方式转让信息或允许他人收集、使用信息，但不包括以下其他方和以下信息：我们的关联方、帮助我们经营我们的网站、开展业务、或者向您提供服务的受信任的第三方，只要这些当事方同意将这些信息保密；当我们相信披露的信息是适当的，是遵守法律、法规、规章制度的或来自于法院或他主管当局的命令、执行我们的网站策略，正常运行网站所需要，关联方提供服务所需或保护我们或他人的权利、财产或安全的。</p><p><br/></p><p>3在您终止使用本平台服务后，我们会停止对您的信息的收集和使用，法律法规或监管部门另有规定的除外。如我们停止运营，我们将及时停止收集您个人信息的活动，将停止运营的通知以逐一送达或公告的形式通知您，并对所持有的您的个人信息进行删除或匿名化处理。&nbsp;</p><p><br/></p><p>七、个人资料的保护</p><p><br/></p><p>1 我们实施妥善的实物、电子、管理及技术方面的措施来保护和保障</p><p><br/></p><p>您的个人资料的安全。我们尽力确保通过我们网站所搜集的任何个人</p><p><br/></p><p>资料皆免于任何与我们无关的第三者的滋扰。我们采取的安全措施包括但不限于：</p><p><br/></p><p>1.1 实物措施：存有您个人资料的记录会被存放在有锁的地方。</p><p><br/></p><p>1.2 电子措施：存有您个人资料的电脑数据会被存放在受严格登入限制的电脑系统和存储媒体上。</p><p><br/></p><p>1.3 管理措施：我们内部设立有对用户信息进行安全保护的相关部门，并建立了相关内控制度，对可能接触到您的信息的工作人员采取严格授权原则，只有经我们授权的职员才能接触到您的个人资料, 这些职员需要遵守我们个人资料保密的内部守则。此外，我们不断对工作人员培训相关法律法规及隐私安全准则和安全意识强化宣导，并定期组织内部相关人员进行应急响应培训和应急演练，使其掌握岗位职责和应急处置策略和规程</p><p><br/></p><p>1.4 技术措施：可能采用如Secure Socket Layer Encryption这种加密技术来输送您的个人资料。</p><p><br/></p><p>1.5 安全措施：为保障您的信息安全，我们致力于使用各种现行通用的安全技术及配套的管理体系来尽量降低您的信息被泄露、毁损、误用、非授权访问、非授权披露和更改的风险。例如：通过网络安全层软件（SSL）进行加密传输、信息加密存储、严格限制数据中心的访问。传输和存储个人敏感信息（含个人生物识别信息）时，我们将采用加密、权限控制、去标识化、脱敏化等安全措施。</p><p><br/></p><p>1.6 其它措施：定期审查我们的个人资料收集，存储和处理流程; 并根据必要的原则限制我们的员工和供应商对您数据的访问权限，且我们的员工和供应商均需遵守严格的合同保密义务。。</p><p><br/></p><p>2 若您知悉我们的网站上有任何安全方面的漏洞, 请马上联系我们, 使我们可以尽快采取妥适的行动。</p><p><br/></p><p>3 尽管实施了上述技术和保安的措施, 我们不能保证资料在互联网上的输送绝对安全, 因此我们不能绝对保证您通过我们网站提供给我们的个人资料在一切时候都是安全的。对任何因未经授权而接触您个人资料所发生的事件我们一槪不承担责任, 于这方面产生或导致的任何损失或损害, 我们不负责赔偿。</p><p><br/></p><p>八、隐私政策的修订</p><p><br/></p><p>我们保留随时修改该隐私政策的权利。我们通过更新和发布新版本的生效日期告诉您我们修订了隐私政策，有时我们会发布通知告诉您隐私政策已修订，但这不是我们的一项义务。您应定期查看隐私政策并关注其修订情况，如果您不同意修订的内容，您应停止立即访问本网站。当隐私政策的更新版本发布，您持续访问本网站显示和表明您同意该更新的内容，并同意遵守该更新的隐私权政策。</p><p><br/></p><p>九、访问、更正和删除您的个人数据&nbsp;</p><p><br/></p><p>您有权根据要求获得您的个人资料副本，并确定我们掌握的关于您的信息是否准确并且是最新的。如果您的任何个人数据不准确，您可以要求更新您的信息。您也可以要求删除您的个人资料，但我们可能会在某些情况下拒绝您的删除请求，例如出于法律要求或其他法律目的。有关数据访问，更正或删除请求，请联系Tebiglobl@outlook.com。 为了响应数据访问，更正或删除请求，我们将验证请求方的身份，以确保他/她在法律上有权提出此类请求。虽然我们的目标是免费回复这些请求，但我们保留在您的请求重复或繁重时向您收取合理费用的权利。&nbsp;</p><p><br/></p><p>十、与我们的沟通</p><p><br/></p><p>1 如果您有任何要求和意见，您可以通过电子邮件Tebiglobl@outlook.com，这是属于我们与您沟通的唯一有效和官方电子邮件，所以我们对您未使用有效的联系方式，任何作为或不作为不承担责任。</p><p><br/></p><p>2 我们只通过本网站上的有效的联系方式发布公告和信息或在本网站张贴公告，所以我们对由于您信任了未通过以上方式获得的信息而产生的任何损失不承担责任。</p><p><br/></p><p>3 若您对我们的隐私政策有任何问题, 欢迎随时联系我们。</p><p><br/></p>',0,1596623737,1596623737,'http://tebiglobal.com/images/zwtp.png','http://tebiglobal.com/images/zwtp.png',0),(143,29,'zh','法律声明',0,0,0,0,'管理员',0,'法律声明','法律声明','<p>法律声明</p><p><br/></p><p>第一条&nbsp;<br/></p><p>本网站的宗旨是在不违反韩国相关法律法规的前提下，尽可能地为全球广大数字资产爱好者及用户提供专业、安全、可信赖的数字资产交易及资产管理服务。但您所在国家或地区属于监管明确禁止数字资产交易的法域或属于被列入相关受制裁国家名单的，您应禁止使用本网站项下的服务。<br/></p><p><br/></p><p>第二条&nbsp;<br/></p><p>本平台致力于为用户创建一个合规、安全、可靠的数字资产交易环境，禁止用户使用本网站从事洗钱、走私、商业贿赂、恶意操纵市场等一切非法交易活动或违法行为。为此我们尽最大努力制定严格的反洗钱反恐怖方案及采取有效的安全风险控制措施，以最大限度地保障用户的合法权益，并使平台自身维持着一个良好的品牌声誉。<br/></p><p><br/></p><p>第三条&nbsp;<br/></p><p>当有权机关出示相应的调查文件要求本网站配合对指定用户进行调查时， 或对用户账户采取查封、冻结或者划转等措施时，本网站将在核查司法文件的有效性和真实性后，按照经平台判定的有权机关的要求协助提供相应的用户数据，或进行相应的操作，因此造成的用户隐私泄露、账户不能操作及由此给用户所造成的其他损失等，本网站不承担任何责任。<br/></p><p><br/></p><p>第四条&nbsp;<br/></p><p>凡使用本网站服务的用户，在交易前均应知悉：数字资产不以任何政府或中央银行为后盾支持，且数字资产价格波动大，持有或使用数字资产具有较高的风险。在作出交易决策前，您应理性审慎自身的财务状况以判断是否适合您。<br/></p><p><br/></p><p>第五条<br/></p><p>本网站使用者因为违反本声明的规定而触犯韩国相关法律的，本网站作为服务的提供方，有义务对平台的规则及服务进行完善， 但本站并无触犯韩国相关法律的动机和事实，对使用者的行为不承担任何连带责任。<br/></p><p><br/></p><p>第六条<br/></p><p>凡以任何方式登录本网站或直接、间接使用本网站服务者，视为自愿接受本网站声明的约束。<br/></p><p><br/></p><p>第七条<br/></p><p>本声明未涉及的问题参见韩国有关法律法规，当本声明与韩国相关法律法规冲突时，以韩国相关法律法规为准。<br/></p><p><br/></p>',0,1596556800,1615058437,'http://tebiglobal.com/images/zwtp.png','http://tebiglobal.com/images/zwtp.png',0),(144,30,'zh','永续合约交易规则',0,0,0,0,'管理员',0,'永续合约交易规则','永续合约交易规则','<p><span class=\" w90 fl tc title\" style=\"padding: 0px; margin: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box; float: left; text-align: center; width: 997.188px; font-size: 20px; font-weight: 700;\">永续合约交易规则</span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><span style=\"padding: 0px; margin: 0px; outlin