n on this website and/or use of the services we provide; you agree to any future changes to our Privacy Policy;</p><p><br/></p><p><br/></p><p><br/></p><p>4 You agree that our affiliates, affiliates, and employees will contact you for products and services that may be of interest to you (unless you have indicated that you do not wish to receive such messages).</p><p><br/></p><p><br/></p><p><br/></p><p>Fourth, the information collected</p><p><br/></p><p><br/></p><p><br/></p><p>1 When you use this website, you agree to our use of cookies to track every action you take and to collect and remember all information you leave, including but not limited to your IP address, geographic location and other information.</p><p><br/></p><p><br/></p><p><br/></p><p>2 If you are willing to use the different types of trading services between digital assets provided on this website, you will need to fill in and provide the following two information when applying for registration:</p><p><br/></p><p><br/></p><p><br/></p><p>2.1 Identity information. This information can help us verify that you are eligible to register as a member of this site, including but not limited to your name, your residential address, mailing address, other certificates issued by your country or government that have proof of your identity and The number involved and all other information that helps us verify your identity (collectively referred to as &quot;identity information&quot;). This identity information varies depending on whether you are an individual user or an institutional user. The information collected by the platform for users from different countries may vary according to the laws and regulations of different jurisdictions. The following information and data are used as an indicative example: individual users: nationality, legal full name (including former name and local language name), ID number, email address, telephone number, social security number (&quot;SSN&quot;), passport Number or any government-issued ID number, date of birth, identification (such as a passport, driver&#39;s license or government-issued identification), personal photos taken by the user within six months of the platform registration date, and other information or documents required by the platform . Institutional users: Company legal name (including legal name in local language), registration information, business phone number, authorized representative and authorized user personal information, main place of business, personal information of all beneficial owners), holding 25% or more Identification documents of the shareholder/beneficial owner of the shares (passport or government-issued ID card), company structure, company-related documents, board resolutions, source of funds declaration, risk and compliance control instructions, and other information or documents required by the platform .</p><p><br/></p><p><br/></p><p><br/></p><p>2.2 Service information. This information helps us to contact you and provide you with different modes of inter-digital asset trading services, including but not limited to your personally identifiable information, contact information, transaction information, and your debit card information and/or other account information. (hereinafter referred to as &quot;service information&quot;). At the same time, please understand that the services we provide to you are constantly updated and developed. If you choose to use other services that are not covered in the above instructions, we need to collect your additional information based on the service. We will explain the scope of information collection through page prompts, interaction process, agreement agreement, and pop-up prompts. With purpose and with your consent.</p><p><br/></p><p><br/></p><p><br/></p><p>3 Security management. When you use the services provided by this website or visit this website, we need to automatically receive and record your web browser information, the type of equipment you use to log in to your account, and to ensure the security and stability of your transactions. Device information such as the model version, device address, IP address and record on the web page you requested to access, location, network environment, device fingerprint information, service log information, software information, location information, etc.</p><p><br/></p><p><br/></p><p><br/></p><p>4 When you use this website or the services it provides, we may improve your use of the website and the services it provides and its security, or in accordance with the court or applicable laws and regulations, in order to improve the use of this website. Or order from other government agencies with jurisdiction to collect more information necessary through our website&#39;s proprietary mailbox or other means we believe to be compliant.</p><p><br/></p><p><br/></p><p><br/></p><p>5 If you access any of the other third party websites or cooperating third parties on this website, you agree and abide by the separate and independent privacy policies of the third party network. We are not responsible for the content or activities of these websites or partners.</p><p><br/></p><p><br/></p><p><br/></p><p>Five, Cookies</p><p><br/></p><p>1 When you visit our website, we use Google Stats through cookies to record our performance and check the effectiveness of online advertising. A cookie is a small amount of data that is sent to your browser and stored on your computer&#39;s hard drive. Cookies can only be sent to your computer&#39;s hard drive when you use your computer to access our website.</p><p><br/></p><p><br/></p><p><br/></p><p>2 Cookies are often used to record the habits and preferences of visitors when browsing various items on our website. The information collected by the cookies is unregistered collective statistics and does not contain personal data.</p><p><br/></p><p><br/></p><p><br/></p><p>3 Cookies cannot be used to obtain data on your hard drive, your email address, and your priva