the platform services, we will stop collecting and using your information, except as otherwise provided by laws and regulations or regulatory authorities. If we stop operating, we will stop the collection of your personal information in a timely manner, notify you of the notice of suspension of operation, one by one, or an announcement, and delete or anonymize your personal information.</p><p><br/></p><p><br/></p><p><br/></p><p>Seven, the protection of personal data</p><p><br/></p><p><br/></p><p><br/></p><p>1 We implement proper physical, electronic, management and technical measures to protect and protect</p><p><br/></p><p><br/></p><p><br/></p><p>The security of your profile. We do our best to ensure that any individuals collected through our website</p><p><br/></p><p><br/></p><p><br/></p><p>The information is exempt from the nuisance of any third party not related to us. The security measures we take include but are not limited to:</p><p><br/></p><p><br/></p><p><br/></p><p>1.1 Physical measures: Records containing your personal data will be stored in a locked place.</p><p><br/></p><p><br/></p><p><br/></p><p>1.2 Electronic measures: Computer data containing your personal data will be stored on computer systems and storage media subject to strict login restrictions.</p><p><br/></p><p><br/></p><p><br/></p><p>1.3 Management measures: We have established relevant departments for the security protection of user information, and established relevant internal control system. We strictly enforce the principle of staff who may come into contact with your information. Only authorized personnel can access you. Personal information, these staff members are required to comply with the internal code of confidentiality of our personal data. In addition, we continue to strengthen the staff training related laws and regulations and privacy and safety guidelines and security awareness, and regularly organize internal personnel to conduct emergency response training and emergency drills to master job responsibilities and emergency response strategies and procedures.</p><p><br/></p><p><br/></p><p><br/></p><p>1.4 Technical measures: Encryption technologies such as Secure Socket Layer Encryption may be used to deliver your personal data.</p><p><br/></p><p><br/></p><p><br/></p><p>1.5 Security measures: To protect the security of your information, we are committed to using all current common security technologies and supporting management systems to minimize the leakage, damage, misuse, unauthorized access, unauthorized disclosure and changes of your information. risks of. For example, encrypted transmission through network security layer software (SSL), encrypted storage of information, and strict restriction on access to data centers. When transmitting and storing personal sensitive information (including personal biometric information), we will use security measures such as encryption, access control, de-identification, and desensitization.</p><p><br/></p><p><br/></p><p><br/></p><p>1.6 Other measures: Regularly review our personal data collection, storage and processing processes; and limit our employees and suppliers&#39; access to your data in accordance with the necessary principles, and our employees and suppliers are subject to strict contract confidentiality. obligation. .</p><p><br/></p><p><br/></p><p><br/></p><p>2 If you are aware of any security vulnerabilities on our website, please contact us immediately so that we can take appropriate action as soon as possible.</p><p><br/></p><p><br/></p><p><br/></p><p>3 Despite the implementation of the above technical and security measures, we cannot guarantee the absolute security of the data on the Internet, so we cannot guarantee that the personal data you provide to us through our website is safe at all times. We are not liable for any incidents that result from unauthorized access to your personal data, and we are not liable for any loss or damage arising or caused in this regard.</p><p><br/></p><p><br/></p><p><br/></p><p>8. Revision of the privacy policy</p><p><br/></p><p><br/></p><p><br/></p><p>We reserve the right to modify this privacy policy at any time. We inform you that we have revised our privacy policy by updating and publishing the effective date of the new version, and sometimes we will post a notice telling you that the privacy policy has been revised, but this is not an obligation of us. You should review the privacy policy on a regular basis and pay attention to its revisions. If you do not agree to the revised content, you should stop accessing this website immediately. When an updated version of the Privacy Policy is released, you continue to access the Site and indicate that you agree to the updated content and agree to abide by the updated Privacy Policy.</p><p><br/></p><p><br/></p><p><br/></p><p>Nine, access, correct and delete your personal data</p><p><br/></p><p><br/></p><p><br/></p><p>You have the right to obtain a copy of your personal information on request and to determine if the information we have about you is accurate and up-to-date. If any of your personal data is inaccurate, you can request to update your information. You may also request that your personal data be deleted, but we may refuse your removal request in certain circumstances, such as for legal or other legal purposes. For data access, corrections or removal requests, please contact Tebiglobl@outlook.com. In response to a data access, correction or deletion request, we will verify the identity of the requesting party to ensure that he/she is legally entitled to make such a request. While our goal is to respond to these requests for free, we reserve the right to charge you a reasonable fee when your request is repeated or heavy.</p><p><br/></p><p><br/></p><p><br/></p><p>X. Communicate with us</p><p><br/></p><p><br/></p><p><br/></p><p>1 If you have any requests and comments, you can email Tebiglobl@outlook.com, which is the only valid and official email that we communicate with you, so we have not used valid contact information for you, any or not As no responsibility.</p><p><br/></p><p><br/></p><p><br/></p><p>2 We only post announcements and information through valid contact information on this website or post announcements on this website, so we are not liable for any loss arising from your trust in information not obtained through the above methods.</p><p><br/></p><p><br/></p><p><br/></p><p>3 If you have any questions about our privacy policy, please feel free to contact us.</p><p><br/></p>',0,1596624643,1596624643,'http://tebiglobal.com/images/zwtp.png','http://tebiglobal.com/images/zwtp.png',0),(148,29,'en','Legal statement',0,0,0,0,'管理员',0,'Legal statement','Legal statement','<p style=\"text-align: center;\">Legal statement</p><p>First</p><p><br/></p><p><br/></p><p><br/></p><p>The purpose of this website is to provide professional, secure and reliable digital asset trading and asset management services to the majority of digital asset enthusiasts and users around the world without violating the relevant laws and regulations of the United States of America. However, if your country or region belongs to a jurisdiction that explicitly prohibits digital asset transactions or is included in the list of relevant sanctioned countries, you should prohibit the use of services under this website.</p><p><br/></p><p><br/></p><p><br/></p><p>Article 2</p><p><br/></p><p><br/></p><p><br/></p><p>This platform is committed to creating a compliant, secure, and reliable digital asset trading environment for users. Users are prohibited from using this website for all illegal trading activities or illegal acts such as money laundering, smuggling, commercial bribery, and malicious manipulation of the market. To this end, we make every effort to formulate strict anti-money laundering and anti-terrorism programs and take effective security risk control measures to maximize the protection of the legitimate rights and interests of users and maintain the platform itself with a good brand reputation.</p><p><br/></p><p><br/></p><p><br/></p><p>Article 3</p><p><br/></p><p><br/></p><p><br/></p><p>When the competent authority presents the corresponding investigation documents and requires this website to cooperate with the investigation of designated users, or to take measures such as sealing, freezing or transfer of user accounts, this website will verify the validity and authenticity of judicial documents, According to the request of the authority authorized by the platform to assist in providing corresponding user data or performing corresponding operations, the privacy of the user, the inoperability of the account, and other losses caused to the user caused by this, etc., the website does not assume any responsibility responsibility.</p><p><br/></p><p><br/></p><p><br/></p><p>Article 4</p><p><br/></p><p><br/></p><p><br/></p><p>Users who use the services of this website should know before the transaction: digital assets are not supported by any government or central bank, and the price of digital assets fluctuates greatly. Holding or using digital assets has a high risk. Before making a trading decision, you should be rational and prudent in your financial situation to determine whether it is suitable for you.</p><p><br/></p><p><br/></p><p><br/></p><p>The fifth</p><p><br/></p><p><br/></p><p><br/></p><p>If the user of this website violates the laws of the United States of America because of violation of the provisions of this statement, as a service provider, this website is obliged to improve the rules and services of the platform. However, this website does not have the motivation and In fact, no joint liability is assumed for the actions of users.</p><p><br/></p><p><br/></p><p><br/></p><p>Article 6</p><p><br/></p><p><br/></p><p><br/></p><p>Anyone who logs into this website or uses the services of this website directly or indirectly is deemed to be willing to be bound by the statement of this website.</p><p><br/></p><p><br/></p><p><br/></p><p>Article 7</p><p><br/></p><p><br/></p><p><br/></p><p>For issues not covered in this statement, please refer to the relevant laws and regulations of the United States of America. When this statement conflicts with the relevant laws and regulations of the United States of America, the relevant laws and regulations of the United States of America shall prevail.</p><p><br/></p>',0,1596624718,1596624718,'http://tebiglobal.com/images/zwtp.png','http://tebiglobal.com/images/zwtp.png',0),(149,30,'en','About anti-money laundering',0,0,0,0,'管理员',0,'About anti-money laundering','About anti-money laundering','<p><span class=\" w90 fl tc title\" style=\"padding: 0px; margin: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box; float: left; text-align: center; width: 997.188px; font-size: 20px; font-weight: 700;\">About anti-money laundering</span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><span style=\"padding: 0px; margin: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><strong style=\"padding: 0px; margin: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><span style=\"padding: 0px; margin: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box; font-size: 20px;\">&quot;Guidelines for Anti-Money Laundering and Anti-Terrorist Financing Users on the BilaGlobalOTC Platform&quot;</span></strong></span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">&nbsp;</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">Article 1: The purpose and basis of the formulation In view of the fact that money laundering activities will seriously jeopardize the development of digital asset transactions, encourage and breed corruption, ruin the social atmosphere, damage the legitimate rights and interests of users, undermine the foundation of the stable operation of digital asset trading platforms, and increase digital assets. The legal and operational risks of the trading platform, the Fire Coin Group comprehensively fulfilled the relevant provisions of the anti-money laundering and anti-terrorism financing laws for the prevention of money laundering and terrorist financing activities, and formulated the provisions in accordance with the “Customer Agreement” and “Management Measures for Large-value Transactions”. Guidelines.</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">Article 2: Scope This guideline applies to all users who trade on the BilaGlobalOTC platform (hereinafter referred to as the “OTC Platform”). Users should follow the legal provisions of anti-money laundering and counter-terrorism financing in their country or region, and implement the provisions of these Guidelines within the scope of the law of the user&#39;s region. If the user&#39;s country or region has stricter requirements, the rules are followed.</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">Article 3: Anti-money laundering and anti-terrorism financing refers to concealing and concealing drug crimes, organized crimes of organized crimes, terrorist crimes, smuggling crimes, corruption and bribery crimes, financial fraud crimes, and destruction in order to prevent criminals from trading through the OTC platform. Money laundering activities such as financial management order crimes and other illegal incomes and the source and nature of their proceeds, in accordance with relevant laws and BilaGlobal anti-money laundering provisions to take relevant measures.</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">Article 4: BilaGlobal Anti-Money Laundering Regulations Anti-money laundering (including anti-terrorism financing, the same below) related rules include the Anti-Money Laundering Rules, the Anti-Money Laundering section of the User Agreement, the Measures for the Management of Large-Scale Transactions and these Guidelines. If the content specified in this guide conflicts with other rules, this guide will apply first.</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">Article 5: Basic Principles of Anti-money Laundering on the OTC Platform The OTC platform conducts customer risk monitoring in accordance with the following principles:</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">The principle of comprehensiveness. The OTC platform will take into account all kinds of risk factors that customers may be suspected of money laundering and take reasonable measures to monitor all customers.</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">The principle of prudence. On the basis of fully understanding the customer, the OTC platform will improve the ability to identify customers and prudently monitor customer risks.</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">The principle of sustainability. The OTC platform will continue to pay attention to customer risks and respond appropriately according to actual conditions.</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">The principle of confidentiality. The customer identity information, transaction information and risk level information held by the OTC platform are strictly confidential and will not be provided to any unit or individual in accordance with legal requirements and regulatory requirements.</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">Hierarchical management principles. The OTC platform regularly reviews the basic customer information stored according to the customer&#39;s risk level. The audit of customers with higher risk levels should be stricter than the review of customers with lower risk levels.</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">Article 6: Submission of individual user documents OTC individual users shall submit the following information and materials in accordance with the relevant provisions of anti-money laundering:</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">Personal name</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">a copy of the ID card or passport;</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">Other information or documents that should be provided by the OTC.</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">Article 7: Submission of institutional user documents OTC institutional users shall submit the following information and materials in accordance with the relevant provisions of the anti-money laundering of fire money:</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">company name;</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">Company registered office address;</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">Legal representative of the company;</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">The legal representative of the company&#39;s domicile;</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">Business license;</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">A copy of the company&#39;s legal representative ID card or passport;</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">Other information or documents that should be provided by the OTC.</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">Article 8: Review of User Documents The OTC platform will verify and record relevant information submitted by customers in accordance with the customer identification system in the relevant provisions of anti-money laundering. If the OTC platform has doubts about the information submitted by customers, it has the right to The competent authority or department performs verification.</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">Article 9: Monitoring of Low-risk Users The OTC platform will detect low-risk users according to the specific requirements of anti-money laundering regulations. The OTC platform reserves the right to adjust low-risk users.</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">Article 10: Monitoring of High-risk Users The OTC platform will conduct audits every six months for high-risk customers, update basic information of customer identity and understand information such as source of funds, use of funds, economic status or business status.</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">Article 11: Preservation of User Files The OTC platform will take necessary measures to keep customer identity information and transaction information for a certain period of time. According to international rules, after the end of the business relationship, the customer transaction information should be kept for at least five years from the end of the transaction.</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">Article 12: User&#39;s attention OTC users should pay attention to the following matters:</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">It is forbidden to lend the user&#39;s own account to others for use;</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">It is forbidden to rent or lend the user&#39;s identity document;</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">It is forbidden to rent, lend, disclose important personal property information such as the user&#39;s account, bank card, passbook, password, etc.;</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">Users should actively cooperate with the OTC platform for customer identification;</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">When trading on the OTC platform, select and use secure third-party financial institutions for payment activities.</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">Article 13: Report of Suspicious Behavior If the OTC platform user finds that any account may engage in money laundering or terrorist financing activities during the platform transaction, the user may report to the OTC platform.</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">Article 14: Interpretation of the Guidelines This guideline is interpreted by the OTC platform.</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">Article 15: Effective Period This Guide shall be implemented as of the date of promulgation.</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p><br/></p>',0,1596624866,1596624866,'http://tebiglobal.com/images/zwtp.png','http://tebiglobal.com/images/zwtp.png',0),(150,30,'en','Perpetual contract trading rules',0,0,0,0,'管理员',0,'Perpetual contract trading rules','Perpetual contract trading rules','<