し、戦います。権利所有者として、このウェブサイトのコンテンツが法的権利と利益を侵害していると信じる場合、書面でこのウェブサイトに提出し、有効な身分証明書、所有権の証明を提供できます。特定のリンクと詳細な侵害認証、このウェブサイトは、適格な通知を受け取った後、対応する法律と規制およびこのウェブサイトのルールに従ってタイムリーに処理されます。</p><p><br/></p><p><br/></p><p><br/></p><p>9、情報公開</p><p><br/></p><p><br/></p><p><br/></p><p>9.1このWebサイトを介して情報を投稿する場合、合法的な目的のために法的かつ準拠する方法でのみ行うことができ、次の条件を遵守します。</p><p><br/></p><p><br/></p><p><br/></p><p>9.1.1このウェブサイトで公開されるすべての情報は、インターネットネットワーク情報セキュリティなどに関する国および地方自治体の関連法規に違反してはなりません。</p><p><br/></p><p><br/></p><p><br/></p><p>9.1.2ユーザーに公開されるすべての情報を説明し、それから生じるすべての法的責任を独自に引き受けます。</p><p><br/></p><p><br/></p><p><br/></p><p>9.1.3このWebサイトには、お客様へのサービスの提供を変更、削除、一時停止/終了する権利、または違法またはこのWebサイトの規則に準拠していない投稿情報すべてに対してその他の適切な処理を行う権利があります。</p><p><br/></p><p><br/></p><p><br/></p><p>9.2このサイトで情報を公開し、製品を立ち上げ、サービスを提供する他のユーザーについては、ユーザーとあなたは関連する契約または法的文書でそれぞれの権利と義務を明確に規定し、ユーザーはあなたに対する法的責任を独自に引き受けるものとします。</p><p><br/></p><p><br/></p><p><br/></p><p>X.このウェブサイトの連絡先情報</p><p><br/></p><p><br/></p><p><br/></p><p>10.1本契約についてご質問がある場合は、書面でこのウェブサイトにご連絡くださいこのウェブサイトで指定されている唯一の有効な公式メールアドレスは、</p><p class=\"ng-binding c-heading-6 x-hidden-focus\" style=\"box-sizing: inherit; margin-top: 0px; margin-bottom: 0px; font-size: 18px; line-height: 24px; padding: 0px; color: rgb(0, 0, 0); outline-color: transparent !important; outline-style: none !important;\">Tebiglobl@outlook.com<span style=\"font-size: 16px;\">です</span></p><p><br/></p>',0,1596625140,1596625140,'http://tebiglobal.com/images/zwtp.png','http://tebiglobal.com/images/zwtp.png',0),(152,30,'jp','プライバシーポリシー',0,0,0,0,'管理员',0,'プライバシーポリシー','プライバシーポリシー','<p style=\"text-align: center;\">プライバシーポリシー</p><p>まず、両側</p><p><br/></p><p><br/></p><p><br/></p><p>1 Tebi Global Ltd.（以下、「会社」といいます）は、アメリカ合衆国の関連法に基づいてアメリカ合衆国で設立された会社です。 ユーザーがデジタル資産取引を行い、関連するサービス（以下「サービス」または「サービス」と呼ぶ）を提供するためのプラットフォーム。 この契約での表現の便宜のために、会社とウェブサイトはこの契約で「私たち」または他のファーストパーソンの名前をまとめて使用します。</p><p><br/></p><p><br/></p><p><br/></p><p>2本ウェブサイトを訪問する自然人またはその他の対象が本ウェブサイトのユーザーである限り、本契約の利便性は「あなた」または他の二人称を使用して次のとおりです。</p><p><br/></p><p><br/></p><p><br/></p><p>3本契約の便宜上、当社およびお客様は本契約において総称して「当事者」と呼ばれ、当社またはお客様は「当事者」と呼ばれます。</p><p><br/></p><p><br/></p><p><br/></p><p>第二に、プライバシーポリシーの目的</p><p><br/></p><p><br/></p><p><br/></p><p>プライバシーポリシーでは、このウェブサイトへのアクセス、このウェブサイトでの登録、および/または提供するサービスの使用、およびそのような情報の使用、保護、保存、利用方法によってのみ、お客様に関する情報を収集することを定めています。</p><p><br/></p><p><br/></p><p><br/></p><p>第三に、あなたの同意</p><p><br/></p><p><br/></p><p><br/></p><p>個人データの取り扱いに完全に自信を持っていることを保証するために、プライバシーポリシーの規定を詳細に読んで理解する必要があります。特に、ウェブサイトにログインした後は、ウェブサイトに登録するかどうかにかかわらず、次のことに同意し、同意し、約束し、確認することを示します。</p><p><br/></p><p><br/></p><p><br/></p><p>1お客様は、必要な同意を得て、自発的に個人情報を開示します。</p><p><br/></p><p><br/></p><p><br/></p><p>2お客様は、このプライバシーポリシーのすべての条件を遵守します。</p><p><br/></p><p><br/></p><p><br/></p><p>3お客様は、このウェブサイトへのアクセス、このウェブサイトへの登録、および/または提供するサービスの使用を通じてお客様の情報を収集することに同意し、プライバシーポリシーの今後の変更に同意します。</p><p><br/></p><p><br/></p><p><br/></p><p>4あなたは、当社の関連会社、関連会社、および従業員が、あなたが興味を持ちそうな製品やサービスについてあなたに連絡することに同意します（そのようなメッセージの受信を望まないことを示さない限り）。</p><p><br/></p><p><br/></p><p><br/></p><p>第四に、収集された情報</p><p><br/></p><p><br/></p><p><br/></p><p>1このWebサイトを使用する場合、Cookieを使用して実行するすべてのアクションを追跡し、IPアドレス、地理的位置、その他の情報を含むがこれらに限定されない、残すすべての情報を収集および記憶することに同意するものとします。</p><p><br/></p><p><br/></p><p><br/></p><p>2このWebサイトで提供されるデジタル資産間で異なる種類の取引サービスを使用する場合は、登録を申請するときに次の2つの情報を入力して提供する必要があります。</p><p><br/></p><p><br/></p><p><br/></p><p>2.1識別情報。この情報は、名前、住所、住所、国または政府が発行した身元を証明する証明書を含むがこれらに限定されない、このサイトのメンバーとして登録する資格があることを確認するのに役立ちます。関係する番号と、お客様の身元を確認するのに役立つその他のすべての情報（総称して「身元情報」と呼びます）。このID情報は、ユーザーが個人ユーザーであるか機関ユーザーであるかによって異なり、さまざまな国のユーザー向けにプラットフォームが収集する情報は、管轄区域の法律や規制によって異なる場合があります。以下の情報とデータが参考例として使用されます：個々のユーザー：国籍、正式な氏名（以前の名前と現地の言語名を含む）、ID番号、メールアドレス、電話番号、社会保障番号（ &quot;SSN&quot;）、パスポート番号または政府発行のID番号、生年月日、身分証明書（パスポート、運転免許証、政府発行の身分証明書など）、プラットフォーム登録日から6か月以内にユーザーが撮影した個人写真、およびプラットフォームで必要なその他の情報または文書。法人ユーザー：会社の法的な名前（現地語の法的な名前を含む）、登録情報、会社の電話番号、権限のある代表者および権限のあるユーザーの個人情報、主要な事業所、すべての受益者の個人情報）、25％以上を保持株式の株主/受益者の身分証明書（パスポートまたは政府発行のIDカード）、企業構造、企業関連文書、取締役会決議、資金源の宣言、リスクおよびコンプライアンス管理指示、およびプラットフォームで必要なその他の情報または文書。</p><p><br/></p><p><br/></p><p><br/></p><p>2.2サービス情報。この情報は、個人を特定できる情報、連絡先情報、取引情報、デビットカード情報および/またはその他のアカウント情報を含むがこれらに限定されない、デジタルアセット取引サービスのさまざまなモードを提供するのに役立ちます。 （以下「サービス情報」と呼びます）。同時に、お客様に提供するサービスは常に更新および開発されていることをご理解ください。上記の手順で説明されていない他のサービスを使用することを選択した場合、サービスに基づいて追加情報を収集する必要があります。ページプロンプト、対話プロセス、契約合意、ポップアッププロンプトを通じて情報収集の範囲を説明します。目的を持って、あなたの同意を得て。</p><p><br/></p><p><br/></p><p><br/></p><p>3セキュリティ管理。このウェブサイトが提供するサービスを使用するか、このウェブサイトにアクセスすると、ウェブブラウザ情報、アカウントへのログインに使用する機器の種類を自動的に受信して記録し、取引のセキュリティと安定性を確保する必要があります。モデルバージョン、デバイスアドレス、IPアドレス、アクセスをリクエストしたWebページの記録、場所、ネットワーク環境、デバイスの指紋情報、サービスログ情報、ソフトウェア情報、場所情報などのデバイス情報</p><p><br/></p><p><br/></p><p><br/></p><p>4このWebサイトまたはそれが提供するサービスを使用する場合、このWebサイトの使用を改善するために、裁判所または適用される法律および規制に従って、Webサイトおよび提供するサービスとそのセキュリティの使用を改善する場合があります。または、当社のウェブサイト独自のメールボックスまたは準拠していると思われるその他の手段を通じて、必要な情報を収集するよう管轄権を持つ他の政府機関に命令してください。</p><p><br/></p><p><br/></p><p><br/></p><p>5このWebサイトで他のサードパーティWebサイトまたは協力するサードパーティにアクセスする場合、サードパーティネットワークの個別の独立したプライバシーポリシーに同意し、遵守します。これらのウェブサイトまたはパートナーのコンテンツまたは活動については責任を負いません。</p><p><br/></p><p><br/></p><p><br/></p><p>5、クッキー</p><p><br/></p><p>1当社のウェブサイトにアクセスすると、Cookieを介してGoogle Statsを使用してパフォーマンスを記録し、オンライン広告の有効性を確認します。 Cookieは、ブラウザーに送信され、コンピューターのハードドライブに保存される少量のデータです。 Cookieは、コンピューターを使用して当社のWebサイトにアクセスする場合にのみ、コンピューターのハードドライブに送信できます。</p><p><br/></p><p><br/></p><p><br/></p><p>2クッキーは、当社ウェブサイトのさまざまなアイテムを閲覧する際の訪問者の習慣や好みを記録するためによく使用されます。 Cookieによって収集される情報は未登録の集合統計であり、個人データは含まれません。</p><p><br/></p><p><br/></p><p><br/></p><p>3 Cookieを使用してハードドライブ、電子メールアドレス、および個人データのデータを取得することはできません。これにより、Webサイトまたはサービスプロバイダーシステムがブラウザーを認識し、情報を取得および記憶できます。ほとんどのブラウザは、Cookieを受け入れるように事前設定されています。 Cookieを受け入れないようにブラウザを設定するか、Cookieがインストールされている場合に通知するように選択できます。ただし、Cookieを禁止すると、ウェブサイトの特定の機能を有効にしたり使用したりできなくなる場合があります。</p><p><br/></p><p><br/></p><p><br/></p><p>第六に、情報の使用</p><p><br/></p><p><br/></p><p><br/></p><p>1当社は、お客様から収集した情報を以下の目的または以下の方法で使用します。</p><p><br/></p><p><br/></p><p><br/></p><p>1.1登録を処理し、このWebサイトで提供されるサービスを提供します。</p><p><br/></p><p><br/></p><p><br/></p><p>1.2当社のサービスに対する変更を通知します。</p><p><br/></p><p><br/></p><p><br/></p><p>1.3関連する主権国家または地域の管轄当局の要件に従って、関連する規制当局に報告する。</p><p><br/></p><p>1.4このWebサイトで提供されるサービスを使用する場合、このWebサイトは、ID、顧客サービス、セキュリティ、不正監視、マーケティングとプロモーション、アーカイブとバックアップ、またはこのWebサイトを第三者と共同で宣伝するなど、正当な目的でお客様の情報を使用します。このWebサイトから提供される製品およびサービスのセキュリティを確保するため。</p><p><br/></p><p><br/></p><p><br/></p><p>1.5サイトが新しい製品やサービスを設計するのを支援し、サイトで提供される既存のサービスを改善するために、情報を収集および処理します。</p><p><br/></p><p><br/></p><p><br/></p><p>1.6このウェブサイトで提供されるサービスの特定の内容を理解できるようにするために、このウェブサイトがお客様に関連するマーケティング活動に関する情報を随時送信することに同意します（Huobiが提供する会社のニュース、プロモーション情報、関連製品およびサービス）情報）、一般的な完全に配布された広告に代わる商用電子情報および広告;</p><p><br/></p><p><br/></p><p><br/></p><p>1.7は、このWebサイトで提供されるサービスに関連する調査に参加するよう招待します。</p><p><br/></p><p><br/></p><p><br/></p><p>1.8政府機関、公共機関、協会などと協力したデータ分析。</p><p><br/></p><p><br/></p><p><br/></p><p>1.9請求処理と手数料の請求。</p><p><br/></p><p><br/></p><p><br/></p><p>1.10あなたの体験をパーソナライズします（あなたの情報は私たちがあなたの個々のニーズによりよく応えるのに役立ちます）</p><p><br/></p><p><br/></p><p><br/></p><p>1.11マネーロンダリング、テロ資金調達、貿易回避、経済制裁を防ぐために国際基準を採用しました。最終的な仮想資産の条件が施行された場合、それを実施しますので、クライアントに対してデューデリジェンスを実施する必要があります。これには、サードパーティのデータおよびサービスプロバイダーを使用して、個人情報とそのデータを照合することが含まれます。</p><p><br/></p><p><br/></p><p><br/></p><p>1.12は、他のすべての法的目的およびお客様が許可するその他の目的に使用されます。</p><p><br/></p><p><br/></p><p><br/></p><p>2当社は、情報を他者に販売、取引、または他の方法で転送したり、他者による情報の収集および使用を許可したりしませんが、以下のその他の関係者および以下の情報を含みません：当社の関連会社、当社のウェブサイトの運営、事業の実施、または第三者がそのような情報を秘密にすることに同意する限り、お客様にサービスを提供する信頼できる第三者。開示された情報が適切であると考える場合、法律、規制、規則または規制に準拠して、または裁判所またはその権限のある当局から必要に応じてウェブサイトポリシーを指揮し、実行し、ウェブサイトを運営します。関連する当事者が必要なサービスを提供するか、弊社または他者の権利、財産またはセキュリティを保護します。</p><p><br/></p><p><br/></p><p><br/></p><p>3お客様がプラットフォームサービスの使用を終了した後、法律または規制当局によって別途提供される場合を除き、お客様の情報の収集と使用を停止します。運用を停止した場合、タイムリーにお客様の個人情報の収集を停止し、運用の停止の通知、または通知をお客様に通知し、お客様の個人情報を削除または匿名化します。</p><p><br/></p><p><br/></p><p><br/></p><p>7、個人データの保護</p><p><br/></p><p><br/></p><p><br/></p><p>1保護および保護するための適切な物理的、電子的、管理および技術的対策を実施</p><p><br/></p><p><br/></p><p><br/></p><p>プロファイルのセキュリティ。私たちは、個人が当社のウェブサイトを通じて収集されることを保証するために最善を尽くします</p><p><br/></p><p><br/></p><p><br/></p><p>この情報は、当社に関係のない第三者の迷惑から免除されます。当社が講じるセキュリティ対策には以下が含まれますが、これらに限定されません。</p><p><br/></p><p><br/></p><p><br/></p><p>1.1物理的手段：個人データを含む記録は、ロックされた場所に保存されます。</p><p><br/></p><p><br/></p><p><br/></p><p>1.2電子的手段：個人データを含むコンピューターデータは、厳格なログイン制限に従ってコンピューターシステムおよびストレージメディアに保存されます。</p><p><br/></p><p><br/></p><p><br/></p><p>1.3管理措置：ユーザー情報のセキュリティ保護のために関連部門を設置し、関連する内部統制システムを確立しました。お客様の情報に接触する可能性のあるスタッフの原則を厳格に施行します。個人情報、これらのスタッフメンバーは、当社の個人データの機密の内部コードを遵守する必要があります。さらに、スタッフトレーニング関連の法律と規制、プライバシーと安全に関するガイドライン、セキュリティ意識を強化し続け、社内担当者を定期的に編成して、緊急時対応トレーニングと緊急時訓練を実施し、職責と緊急時対応戦略と手順を習得します。</p><p><br/></p><p><br/></p><p><br/></p><p>1.4技術的手段：Secure Socket Layer Encryptionなどの暗号化技術を使用して、個人データを配信できます。</p><p><br/></p><p><br/></p><p><br/></p><p>1.5セキュリティ対策：情報のセキュリティを保護するために、情報の漏洩、損傷、誤用、不正アクセス、不正開示、変更を最小限に抑えるために、現在のすべての一般的なセキュリティ技術とサポート管理システムを使用することをお約束します。リスク。たとえば、ネットワークセキュリティレイヤーソフトウェア（SSL）による暗号化された送信、暗号化された情報の保存、データセンターへのアクセスの厳格な制限。個人の機密情報（個人の生体認証情報を含む）を送信および保存する場合、暗号化、アクセス制御、匿名化、減感などのセキュリティ対策を使用します。</p><p><br/></p><p><br/></p><p><br/></p><p>1.6その他の措置：個人データの収集、保存、処理プロセスを定期的にレビューし、従業員とサプライヤーが必要な原則に従ってお客様のデータへのアクセスを制限します。従業員とサプライヤーは厳格な契約守秘義務の対象となります。義務。 。</p><p><br/></p><p><br/></p><p><br/></p><p>2当社のウェブサイトのセキュリティの脆弱性に気付いた場合は、できるだけ早く適切な措置を講じられるよう、すぐにご連絡ください。</p><p><br/></p><p><br/></p><p><br/></p><p>3上記の技術的およびセキュリティ対策の実装にもかかわらず、インターネット上のデータの絶対的なセキュリティを保証することはできません。そのため、当社のウェブサイトを通じて提供された個人データが常に安全であることを保証することはできません。当社は、お客様の個人データへの不正アクセスに起因するインシデントについて責任を負いません。また、この点で発生または引き起こされた損失または損害について責任を負いません。</p><p><br/></p><p><br/></p><p><br/></p><p>8.プライバシーポリシーの改訂</p><p><br/></p><p><br/></p><p><br/></p><p>当社は、いつでもこのプライバシーポリシーを変更する権利を留保します。新しいバージョンの発効日を更新して公開することでプライバシーポリシーを改訂したことをお知らせします。また、プライバシーポリシーが改訂されたことを知らせる通知を掲載する場合がありますが、これは当社の義務ではありません。プライバシーポリシーを定期的に確認し、改訂に注意する必要があります改訂されたコンテンツに同意しない場合は、このWebサイトへのアクセスをすぐに停止する必要があります。プライバシーポリシーの更新バージョンがリリースされると、サイトに引き続きアクセスし、更新されたコンテンツに同意し、更新されたプライバシーポリシーに従うことに同意したことを示します。</p><p><br/></p><p><br/></p><p><br/></p><p>個人データを9つ、アクセス、修正、削除する</p><p><br/></p><p><br/></p><p><br/></p><p>お客様は、ご要望に応じて個人情報のコピーを取得し、お客様に関する当社の情報が正確かつ最新であるかどうかを判断する権利を有します。不正確な個人データがある場合は、情報の更新をリクエストできます。また、個人データの削除をリクエストすることもできますが、法的またはその他の法的目的などの特定の状況では、削除リクエストを拒否する場合があります。データへのアクセス、修正、または削除のリクエストについては、Tebiglobl@outlook.comまでお問い合わせください。データへのアクセス、修正、または削除のリクエストに応じて、リクエストした当事者の身元を確認し、そのようなリクエストを行う法的権利があることを確認します。私たちの目標はこれらのリクエストに無料で対応することですが、リクエストが繰り返されたり重い場合には、合理的な料金を請求する権利を留保します。</p><p><br/></p><p><br/></p><p><br/></p><p>X.私たちと通信する</p><p><br/></p><p><br/></p><p><br/></p><p>1リクエストやコメントがある場合は、Tebiglobl@outlook.comにメールを送信できます。これは、有効で正式なメールであり、有効な連絡先情報を使用していません。責任なし。</p><p><br/></p><p><br/></p><p><br/></p><p>2弊社は、このウェブサイト上の有効な連絡先情報またはこのウェブサイト上のお知らせを介して発表および情報のみを掲載するため、上記の方法で得られなかった情報に対するお客様の信頼から生じるいかなる損失についても責任を負いません。</p><p><br/></p><p><br/></p><p><br/></p><p>3プライバシーポリシーについてご質問がある場合は、お気軽にお問い合わせください。</p><p><br/></p><p><br/></p><p><br/></p><p><br/></p>',0,1596625233,1596625233,'http://tebiglobal.com/images/zwtp.png','http://tebiglobal.com/images/zwtp.png',0),(153,29,'jp','法律上の声明',0,0,0,0,'管理员',0,'法律上の声明','法律上の声明','<p><span class=\" w90 fl tc title\" style=\"padding: 0px; margin: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box; float: left; text-align: center; width: 997.188px; font-size: 20px; font-weight: 700;\">法律上の声明</span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">最初に</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">このウェブサイトの目的は、米国の関連法規制に違反することなく、世界中の大多数のデジタル資産愛好家およびユーザーに専門的で安全で信頼性の高いデジタル資産取引および資産管理サービスを提供することです。ただし、お住まいの国または地域がデジタル資産取引を明示的に禁止している管轄区域に属している場合、または関連する制裁対象国のリストに含まれている場合は、このWebサイトでのサービスの使用を禁止する必要があります。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">記事2</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">このプラットフォームは、ユーザーに準拠した安全で信頼できるデジタル資産取引環境を作成することを約束します。ユーザーは、すべての違法取引活動またはマネーロンダリング、密輸、商業賄ber、市場の悪意のある操作などの違法行為にこのウェブサイトを使用することを禁じられています。この目的のため、厳格なマネーロンダリング防止およびテロ対策プログラムを策定し、ユーザーの正当な権利と利益の保護を最大化し、プラットフォーム自体を良好なブランド評価で維持するための効果的なセキュリティリスク管理手段を講じるようにあらゆる努力を払っています。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">記事3</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">管轄当局が対応する調査書類を提示し、このウェブサイトに指定ユーザーの調査と協力するか、ユーザーアカウントの封印、凍結、譲渡などの措置を講じることを要求する場合、このウェブサイトは司法文書の有効性と信頼性を検証し、対応するユーザーデータの提供または対応する操作の実行、ユーザーのプライバシー、アカウントの操作不能性、およびこれによって引き起こされるユーザーに対するその他の損失を支援するためにプラットフォームによって許可された機関の要求に従って、ウェブサイトは一切の責任を負いません責任。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">第4条</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">このウェブサイトのサービスを使用するユーザーは、取引の前に知っておく必要があります：デジタル資産は政府や中央銀行によってサポートされておらず、デジタル資産の価格は大きく変動します。取引を決定する前に、財務状況を合理的かつ慎重に判断して、適切かどうかを判断する必要があります。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">第5条</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">このウェブサイトのユーザーがサービスプロバイダーとしてこの声明の条項に違反してアメリカ合衆国の法律に違反した場合、このウェブサイトはプラットフォームのルールとサービスを改善する義務があります。実際、ユーザーの行動に関して共同責任は負いません。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">記事6</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">このウェブサイトにログインするか、このウェブサイトのサービスを直接または間接的に使用する人は誰でも、このウェブサイトの声明に拘束されるとみなされます。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">記事7</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">この声明でカバーされていない問題については、アメリカ合衆国の関連法規を参照してください。この声明がアメリカ合衆国の関連法規と矛盾する場合、アメリカ合衆国の関連法規が優先します。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p><br/></p>',0,1596625279,1596625279,'http://tebiglobal.com/images/zwtp.png','http://tebiglobal.com/images/zwtp.png',0),(154,30,'jp','マネーロンダリング防止について',0,0,0,0,'管理员',0,'マネーロンダリング防止について','マネーロンダリング防止について','<p><span class=\" w90 fl tc title\" style=\"padding: 0px; margin: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box; float: left; text-align: center; width: 997.188px; font-size: 20px; font-weight: 700;\">マネーロンダリング防止について</span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><span style=\"padding: 0px; margin: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box; color: rgb(0, 0, 0);\"><strong style=\"padding: 0px; margin: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><span style=\"padding: 0px; margin: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box; font-size: 18px;\">「BilaGlobalOTCプラットフォームでのマネーロンダリング防止およびテロ対策資金調達ユーザー向けのガイドライン」</span></strong></span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">&nbsp;</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">第1条：策定の目的と根拠マネーロンダリング活動は、デジタル資産取引の開発を深刻に危険にさらし、腐敗を助長し、繁殖させ、社会的雰囲気を破壊し、ユーザーの正当な権利と利益を損ない、デジタル資産取引プラットフォームの安定運用の基盤を損ない、デジタル資産を増加させるという事実に鑑みて。取引プラットフォームの法的および運用上のリスクであるFire Coin Groupは、マネーロンダリング防止およびテロ資金調達活動のためのマネーロンダリング防止およびテロ対策資金調達法の関連規定を包括的に満たし、「顧客契約」および「大規模取引の管理措置」に従って規定を策定しました。ガイドライン。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">記事2：範囲このガイドラインは、BilaGlobalOTCプラットフォーム（以下「OTCプラットフォーム」と呼びます）で取引するすべてのユーザーに適用されます。ユーザーは、国または地域でのマネーロンダリング防止およびテロ対策資金調達の法的規定に従い、ユーザーの地域の法律の範囲内でこれらのガイドラインの規定を実装する必要があります。ユーザーの国または地域の要件がより厳しい場合、ルールに従います。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">第3条：マネーロンダリング防止およびテロ対策資金調達とは、薬物犯罪、組織犯罪の組織犯罪、テロ犯罪、密輸犯罪、汚職および贈収賄犯罪、金融詐欺犯罪、およびOTCプラットフォームを介した取引を防止するための破壊の隠蔽および隠蔽を指します。関連する法律および関連する措置を講じるBilaGlobalのマネーロンダリング防止規定に従って、財務管理命令犯罪やその他の違法な収入などのマネーロンダリング活動、およびその収益の源泉と性質。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">第4条：BilaGlobalのマネーロンダリング防止規則マネーロンダリング防止（テロ対策資金を含む、以下同じ）関連のルールには、マネーロンダリング防止ルール、ユーザー契約のマネーロンダリング防止セクション、大規模取引の管理措置、およびこれらのガイドラインが含まれます。このガイドで指定されているコンテンツが他のルールと矛盾する場合、このガイドが最初に適用されます。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">第5条：OTCプラットフォームでのマネーロンダリング防止の基本原則OTCプラットフォームは、次の原則に従って顧客リスクの監視を実施します。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">包括性の原則。 OTCプラットフォームは、顧客がマネーロンダリングの疑いがあるあらゆる種類のリスク要因を考慮し、すべての顧客を監視するための合理的な手段を講じます。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">慎重さの原則。 OTCプラットフォームは、顧客を完全に理解することに基づいて、顧客を識別し、顧客のリスクを慎重に監視する能力を向上させます。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">持続可能性の原則。 OTCプラットフォームは、引き続き顧客のリスクに注意を払い、実際の状況に応じて適切に対応します。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">守秘義務の原則。 OTCプラットフォームが保持する顧客ID情報、取引情報、およびリスクレベル情報は極秘であり、法的要件および規制要件に従って、ユニットまたは個人に提供されることはありません。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">階層管理の原則。 OTCプラットフォームは、顧客のリスクレベルに応じて保存されている基本的な顧客情報を定期的にレビューします。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">第6条：個々のユーザー文書の提出OTCの個々のユーザーは、マネーロンダリング防止の関連規定に従って、以下の情報と資料を提出するものとします。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">個人名</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">IDカードまたはパスポートのコピー。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">OTCが提供する必要があるその他の情報または文書。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">第7条：機関ユーザー文書の提出OTC機関ユーザーは、火災マネーのマネーロンダリング防止の関連規定に従って、以下の情報と資料を提出するものとします。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">会社名;</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">会社の登録オフィスの住所。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">会社の法定代理人;</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: