le\" style=\"padding: 0px; margin: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box; float: left; text-align: center; width: 997.188px; font-size: 20px; font-weight: 700;\">關於反洗錢</span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">《Tebi GlobalOTC平台反洗錢和反恐怖融資用戶指引》</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">&nbsp;</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">第一條：制定的目的和依據鑑於洗錢活動將嚴重危害數字資產交易的發展，助長和滋生腐敗、敗壞社會風氣，損害用戶的正當權益，破壞數字資產交易平台穩健經營的基礎，加大數字資產交易平台的法律和運營風險，火幣集團為預防洗錢和恐怖融資活動，全面履行反洗錢和反恐融資法律的相關規定，根據《客戶協議》、《大額交易管理辦法》等公司規定，制定本指引。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">第二條：適用範圍 本指引適用於在BilaGlobalOTC平台（以下簡稱“OTC平台”）交易的所有用戶。用戶應當在遵循其所在地國家或地區反洗錢和反恐融資方面的法律規定，在用戶所在地區法律規定的範圍內，執行本指引之規定。用戶所在國家或者地區有更嚴格要求的，遵守其規定。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">第三條：反洗錢和反恐怖融資是指為了防範不法分子通過OTC平台進行交易從而掩飾、隱瞞毒品犯罪、黑社會性質的組織犯罪、恐怖活動犯罪、走私犯罪、貪污賄賂犯罪、金融詐騙犯罪、破壞金融管理秩序犯罪等違法所得及其收益的來源和性質的洗錢活動，依照相關法律和BilaGlobal反洗錢相關規定採取相關措施的行為。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">第四條：BilaGlobal反洗錢相關規定 反洗錢（包括反恐怖融資，下同）相關規則包括《反洗錢規則》、《用戶協議》中反洗錢的部分、《大額交易管理辦法》與本指引。若本指引中規定的內容與其它規則相衝突，則本指引優先適用。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">第五條：OTC平台反洗錢基本原則 OTC平台按照以下原則開展客戶風險監控工作：</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">全面性原則。 OTC平台會綜合考慮客戶可能涉嫌洗錢的各類風險因素，採取合理方式對所有客戶進行風險監控。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">審慎性原則。 OTC平台會在充分了解客戶的基礎上，提高對客戶身份的識別能力，審慎進行客戶風險監控。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">持續性原則。 OTC平台會對客戶風險進行持續關注，根據實際情況適做出應對。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">保密性原則。 OTC平台所掌握的客戶身份信息、交易信息和風險等級信息等予以嚴格保密，非依法律規定和監管要求，不會向任何單位和個人提供。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">分級管理原則。 OTC平台根據客戶的風險等級，定期審核所保存的客戶基本信息，對風險等級較高客戶的審核應當嚴於對風險等級較低客戶的審核。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">第六條：個人用戶文件之提交 OTC個人用戶應當依據反洗錢相關規定提交以下信息和資料：</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">個人姓名；</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">身份證或護照複印件；</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">其它應OTC要求應當提供之信息或文件。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">第七條：機構用戶文件之提交 OTC機構用戶應當依據火幣反洗錢相關規定提交以下信息和資料：</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">公司名稱；</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">公司註冊辦公地址；</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">公司法定代表人；</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">公司法定代表人住所地；</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">公司營業執照；</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">公司法定代表人身份證或護照複印件；</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">其它應OTC要求應當提供之信息或文件。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">第八條：用戶文件之審查OTC平台會依據反洗錢相關規定中的客戶識別制度對客戶所提交的相關信息進行核實和記錄，若OTC平台對於客戶所提交的資料有疑問時，有權向相關主管機構或部門進行核實。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">第九條：低風險用戶之監測 OTC平台會根據反洗錢規定的具體要求對低風險用戶進行檢測，OTC平台保留對低風險用戶進行調級的權利。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">第十條：高風險用戶之監測 OTC平台對於高風險類別的客戶，會於每半年進行一次審核，更新客戶身份基本信息並了解其資金來源、資金用途、經濟狀況或者經營狀況等信息。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">第十一條：用戶文件之保存 OTC平台會依法採取必要措施將客戶身份資料和交易信息保存一定期限。參照國際通行規則，用戶身份資料自業務關係結束後，客戶交易信息自交易結束後，應至少保存五年。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">第十二條：用戶之注意 OTC用戶應當注意以下事項：</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">禁止將用戶本人的賬號出借給他人使用；</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">禁止出租、出借用戶本人身份證件；</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">禁止出租、出借、透露用戶本人的賬戶、銀行卡、存摺、密碼等重要個人財產信息；</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">用戶應當主動配合OTC平台進行客戶身份識別；</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">在OTC平台進行交易時，選擇並使用安全可靠的第三方金融機構進行支付活動。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">第十三條：可疑行為之報告 若OTC平台用戶在平台交易時發現任何賬戶可能從事洗錢或恐怖融資活動，用戶可以向OTC平台進行報告。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">第十四條：指引之解釋 本指引由OTC平台進行解釋。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\">第十五條：生效期 本指引自發布之日起實施。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box;\"><br/></p><p><br/></p><p class=\"tr\" style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; outline: 0px; text-size-adjust: none; box-sizing: border-box; text-align: right; color